(1, 'Traditional', 'traditional', 2, 20, 13, 'Makanan traditional khas buatan indonesia', 'makanan traditional khas buatan indonesia', 'publish', '2018-03-25 16:54:46', '2018-04-05 18:28:23', '2018-04-05 18:28:23', 'Traditional', 'makanan traditional khas buatan indonesia', 'traditional,makanan kategori traditional'),
