(3, 'Coffee', 'coffee', 14, 11, 1, 'kategori coffee', 'kategori coffee', 'publish', '2018-03-26 03:23:55', '2018-04-05 16:44:27', '2018-04-05 16:44:27', 'kategori coffee', 'kategori coffee', 'kopi,coffee'),
