(5, 'Tahu Bulat', 'tahu-bulat', 54, 20, 1, 'Tahu Bulat adalah makanan khas Indonesia yang disukai oleh banyak kalangan.', 'Cemilan ini bisa ditemukan diberbagai pelosok jalanan kota-kota di Indonesia. Cemilan yang sangat dekat dengan rakyat', 'publish', '2018-03-28 14:33:49', '2018-04-05 16:44:34', '2018-04-05 16:44:34', 'Tahu Bulat', 'tahu bulat cemilan mantap', 'tahu, bulat, tahu bulat'),
(6, 'Tempe', 'tempe', 60, 20, 13, 'Tempe Mendoan Pertigaan Reni', 'Tempe Mendoan Khas Cirebon ini sangat cocok di makan saat hujan atau cuaca dingin karna tempe mendoan baru akan di goreng saat ada pembeli , apalagi ditemani kopi ABC susu hangat pasti lebih nikmat. Ukuran tempe mendoan ini lumayan besar. Untuk rasanya sendiri sangat enak apalagi dimakan selagi hangat.', 'publish', '2018-03-29 18:26:48', '2018-04-05 21:09:32', '2018-04-05 21:09:32', 'Tempe Mendoan Pertigaan Reni', NULL, 'tempe,tempe mendoan,mendoan,tempe mendoan pertigaan reni'),
(7, 'Telor Gulung', 'telor-gulung', 61, 20, 14, 'Telor Gulung Bihun Pertigaan Reni', 'Jajanan cemilan telor gulung yang udah ada dari zaman dulu ini masih ada yang jual loh. tetapi telur gulung ini ada isian bihunnya. Rasanya enak, dijual dengan harga yang murah pas banget dikantong pelajar. Ditambah saus sambalnya yang pedas bikin rasanya makin nikmat dan lezat. Cocok banget buat cemilan sore hari.\r\n\r\nHarga 	: Rp.1000,-/buah\r\nBuka 	: 18.00 - 23.00', 'publish', '2018-03-30 21:44:34', '2018-04-05 21:09:39', '2018-04-05 21:09:39', 'Telor Gulung Bihun', NULL, 'Telor Gulung,Telor Gulung Bihun,Telor Gulung Pamulang'),
(8, 'Tahu', 'tahu', 62, 20, 13, 'Tahu bulat mantap yang mulai terkenal dan mudah di temukan di jalan pesanggrahan UIN', 'Kalian semua pasti mengenal atau sangat familiar dengan makanan yang satu ini. Ya betul sekali tahu bulat, mungkin saat ini Anda bisa dengan mudah menemukan tahu bulat, karena camilan populer ini mulai dijajakan keliling ke kampung hingga di tengah kota besar menggunakan mobil, dengan iringan musik khas yang pastinya menarik perhatian. Dengan rasa nya yang cukup gurih dan sedikit asin, sangat cocok sekali jika dimakan dengan ditemani Kopi ABC susu', 'publish', '2018-04-01 07:19:09', '2018-04-05 21:12:24', '2018-04-05 21:12:24', 'Tahu Bulat Pesanggrahan UIN', 'Tahu Bulat', 'tahu,bulat,tahu bulat,tahu bulat pesanggrahan,tahu bulan UIN,tahu enak,tahu mantap,tahu hits,hits'),
(9, 'Sempol Ayam', 'sempol-ayam', 91, 19, 13, 'Sempol Ayam Pertigaan Reni', 'Cemilan yang satu ini mungkin masih awam banget ya untuk sebagian orang. Cemilan sempol sosis ini terbuat dari sosis sapi dan ada juga yang sosis ayam dan di balut dengan telur lalu di gulung saat di goreng. Rasanya enak, apalagi ditambah saus sambal pedasnya. Cocok banget buat cemilan sore hari bareng keluarga.\r\n\r\nDepan Madrasah Ibtidaiyah Assa\'adatuddarain', 'publish', '2018-04-01 11:30:45', '2018-04-05 21:12:29', '2018-04-05 21:12:29', 'Sempol Ayam Pertigaan Reni', 'Jam Buka  : 18.00-23.00', 'Sempol ayam,sempol ayam pamulang'),
(10, 'Sempol Sosis', 'sempol-sosis', 92, 19, 14, 'Sempol Sosis Pertigaan Reni', 'Cemilan yang satu ini mungkin masih awam banget ya untuk sebagian orang. Cemilan sempol sosis ini terbuat dari sosis sapi dan ada juga yang sosis ayam dan di balut dengan telur lalu di gulung saat di goreng. Rasanya enak, apalagi ditambah saus sambal pedasnya. Cocok banget buat cemilan sore hari bareng keluarga.', 'publish', '2018-04-01 11:56:04', '2018-04-05 21:10:44', '2018-04-05 21:10:44', 'Sempol Sosis Pertigaan Reni', 'Sempol Sosis Pertigaan Reni', 'Sempol Sosis,Sempol sosis pamulang'),
(11, 'Bakso Goreng', 'bakso-goreng', 93, 2, 14, 'Bakso Goreng Pertigaan Reni', 'Bakso goreng ini lebih dikenal dengan nama Basreng (Bakso Goreng). Bakso goreng ini ukurannya lumayan besar, bentuknya di buat seperti bunga dan ini salah satu daya tarik Bakso Goreng ini. Bakso goreng ini renyah banget rasanya dan disediakan juga saus untuk cocolnya , bisa di cocol maupun di campur menjadi satu.', 'publish', '2018-04-01 12:18:26', '2018-04-05 21:14:18', '2018-04-05 21:14:18', 'Bakso Goreng Pertigaan Reni', 'Bakso Goreng Pertigaan Reni', 'Bakso goreng,basreng,basreng pamulang'),
(12, 'Martabak', 'martabak', 94, 13, 14, 'Martabak Telor Mini Pertigaan Reni', 'Kalau biasanya martabak telor itu punya ukuran yang besar, martabak telor yang satu ini punya ukuran yang lebih kecil dari martabak pada umumnya. Martabak ini terbuat dari kulit lumpia yang diisi dengan telur, irisan kol dan irisan daun bawang. Rasanya gurih dan enak banget gak kalah deh sama martabak telor biasanya.', 'publish', '2018-04-01 12:28:25', '2018-04-05 21:14:15', '2018-04-05 21:14:15', 'Martabak Telor Mini Pertigaan Reni', 'Martabak Telor Mini Pertigaan Reni', 'Martabak,Martabak telor ,martabak telor mini'),
(13, 'Pancong', 'pancong', 63, 16, 13, 'Kue pancong legenda Betawi', 'Salah satu jajanan tradisional Indonesia yang saat ini mulai menghilang adalah Kue Pancong. Menurut catatan sejarah, jajanan kue basah ini berasal dari Jakarta, tak ayal banyak orang menyebut Kue Pancong sebagai ikon Betawi. Selain karena pengaruh camilan negara asing yang masuk, menurut para pedagang yang dulu menjual kue satu ini, mereka mengalami kerugian yang cukup besar. Mengapa? Karena bahan untuk membuat Kue Pancong sendiri tergolong mahal, sedangkan untuk harga jual kue tersebut sangatlah murah sekali di kalangan masyarakat. Sehingga menyebabkan banyak penjual Kue Pancong mengalami gulung tikar. Padahal pancong sangat nikmat dimakan bersama Kopi ABC susu.', 'publish', '2018-04-01 14:27:56', '2018-04-05 21:14:22', '2018-04-05 21:14:22', 'Kue Pancong betawi simpang pejompongan', 'Kue Pancong legenda Betawi', 'kue,pancong,betawi,simpang pejompongan,Pancong Betawi,Pancong Pejompongan'),
(14, 'Bikang', 'bikang', 98, 2, 15, 'Bikang adalah salah satu camilan tradisional yang biasanya dijual bersama dengan kue pukis dan kue basah lain nya', 'Kue yang satu ini cukup menarik dilihat serta cita rasanya lezat yakni kue bikang. Kue bikang yang dijual di pasaran biasanya memiliki bentuk seperti bunga mawar yang merekah dan mekar dengan warna yang sangat cantik sehingga  menarik dipandang mata. Kue yang cantik satu ini terbuat dari tepung beras, tepung kanji dan tepung terigu yang di campur dengan santan dan telur lalu di kukus hingga mekar. Bikang adalah salah satu camilan tradisional yang biasanya dijual bersama dengan kue pukis dan kue basah lain nya. Kita bsa menemukan kue bikang di penjual jajanan pasar dengan harga yang sangat terjangkau. \r\n\r\nHarga : Rp 1500\r\nAlamat : Pasar Modern Paramount\r\nJam Buka : 06.00 – 11.00', 'publish', '2018-04-02 14:59:32', '2018-04-05 21:14:28', '2018-04-05 21:14:28', 'Bikang Mawar Pasar Modern Paramount Serpong', 'Bikang Mawar Pasar Modern Paramount Serpong', 'Kue,kue bikang,bikang,serpong,pasar modern,pasar modern paramount'),
(15, 'Cilok', 'cilok', 99, 3, 14, 'Cilok Kuah CLBK', 'Cemilan yang terbuat dari tepung aci atau tapioka ini khas daerah Jawa Barat. Siapa si yang ga tau sama cilok , tapi kali ini ciloknya berbeda kalo cilok pada umumnya disiram dengan bumbu kacang ,saus dan kecap, kalau cilok satu ini dengan kuah kaldu hampir mirip dengan kuah bakso. Cilok kuah ini dilengkapi dengan tahu kulit atau tahu coklat yang dalamnya diisi dengan adonan ciloknya , untuk menambah cita rasa dari tahunya. Tektur ciloknya pas banget gak keras dan ga terlalu kenyal. Mantap deh', 'publish', '2018-04-02 18:20:04', '2018-04-05 21:14:32', '2018-04-05 21:14:32', 'Cilok Kuah CLBK', 'Cilok Kuah CLBK', 'Cilok kuah,cilok ,cilok kuah cinangka'),
(16, 'Siomay', 'siomay', 100, 19, 14, 'Siomay Bandung Pertigaan Reni', 'Siapa sih yang ga tau sama cemilan satu ini. Siomay khas Bandung ini terbuat dari ikan tengiri, biasanya siomay disajikan dengan berbagai jenis pelengkap seperti telur, tahu, kol, dan pare tergantung permintaan dari pembeli itu sendiri ditambah bumbu siomay yang lezat disiram diatas siomaynya sehingga rasanya lebih nikmat. Siomay ini cocok banget buat cemilan nonton Tv atau saat nongkrong.', 'publish', '2018-04-02 18:31:11', '2018-04-05 21:14:09', '2018-04-05 21:14:09', 'Siomay Bandung Pertigaan Reni', 'Siomay Bandung Pertigaan Reni', 'Siomay ,Siomay Bandung,Siomay Bandung Pamulang'),
(17, 'Onde-onde', 'onde-onde', 64, 15, 14, 'Onde-onde mantap di simpang rempoa', 'Onde-onde merupakan salah satu jajanan pasar paling populer di Indonesia. Ternyata, onde-onde berasal dari China. Makanan ini dibawa oleh pedagang China yang berdagang ke Indonesia, dan kemudian dimodifikasi sesuai dengan kreasi nusantara.  Cara membuat onde-onde adalah dengan menggunakan tepung terigu atau tepung ketan yang permukaannya ditaburi biji wijen. Isi onde-onde beragam, ada pasta kacang hijau maupun kacang merah. Cemilan yang satu ini sangat pas disantap dengan segelas panas Kopi ABC susu.', 'publish', '2018-04-02 21:12:55', '2018-04-05 21:24:47', '2018-04-05 21:24:47', 'Onde-onde Simpang Rempoa', 'Onde-onde mantap Simpang rempoa', 'Onde-onde,onde-onde rempoa,onde-onde simpang rempoa'),
(18, 'Bolu Kukus', 'bolu-kukus', 101, 2, 15, 'Bolu kukus merupakan salah satu jajanan pasar yang disukai banyak orang dari berbagai kalangan, mulai dari anak kecil hingga lansia.', 'Warna nya cantik bukan ? Camilan satu ini adalah Bolu Kukus, dari penampilan nya sangat menarik dengan berbagai warna yang cantik. Bentuk nya mirip dengan cup cake, tapi jangan khawatir, rasanya tak kalah enak dari cup cake yg biasa kita jumpai di mall. Bolu Kukus terbuat dari adonan tepung  terigu, telur, susu, vanili dan bahan lain nya yang di tuangkan pada sebuah cetakan dan dikukus hingga mengembang. Rasanya manis dan tekstur yang sangat lembut membuat bolu kukus ini sangat di minati masyarakat terutama oleh anak-anak. Kita bisa menemukan bolu kukus seperti ini di penjual jajanan pasar dengan harga yang sangat terjangkau.\r\n \r\nHarga : Rp1500\r\nAlamat : Pasar Modern Paramount\r\nJam Buka : 06.00 – 11.00', 'publish', '2018-04-03 10:33:11', '2018-04-05 21:15:40', '2018-04-05 21:15:40', 'Bolu Kukus Mekar', 'Bolu Kukus Mekar', 'Bolu,bolu kukus,bolu kukus mekar,pasar modern,paramount,serpong'),
(19, 'Bugis', 'bugis', 102, 2, 15, 'Walaupun namanya kue bugis, tapi kue ini asalnya bukan dari Bugis, lho.', 'Kalau makanan yang terbuat dari tepung ketan ini namanya kue bugis. Walaupun namanya kue bugis, tapi kue ini asalnya bukan dari Bugis, lho. Biasanya kue ini juga kerap disajikan saat acara kumpul keluarga atau arisan. Teksturnya yang sedikit liat dengan semburat rasa manis dan gurih dari isian kelapanya membuat kue ini semakin enak.', 'publish', '2018-04-03 11:12:15', '2018-04-03 11:12:15', NULL, 'Kue Bugis Toko Kue Hany', 'Kue Bugis Toko Kue Hany', 'Bugis,Kue bugis,toko kue,toko kue hany'),
(20, 'Cucur', 'cucur', 104, 3, 15, 'Kue Cucur adalah salah satu jajanan tradisional yang kaya akan manfaat dan mudah didapatkan.', 'Kue cucur, jajanan berbentuk bulat dan berwarna kecoklatan ini merupakan jajanan yang cukup dikenal sebagai jajanan untuk upacara-upacara adat di berbagai daerah di Indonesia.', 'publish', '2018-04-03 13:54:35', '2018-04-05 18:28:13', '2018-04-05 18:28:13', 'Kue Cucur Pasar Bengkok', 'Kue Cucur Pasar Bengkok', 'KUE CUCUR,CUCUR,PASAR,BENGKOK,PASARBENGKOK,PASAR BENGKOK'),
(21, 'Carang Mas', 'carang-mas', 108, 3, 15, 'Kue carang mas merupakan jajanan atau camilan tradisional yang sudah ada dari dulu, dan hingga kini masih banyak yang menyukai jajanan ini.', 'Kue carang mas atau walangan merupakan jajanan atau camilan tradisional yang sudah ada dari dulu, dan hingga kini masih banyak yang menyukai jajanan ini. Carang mas merupakan camilan khas Indonesia yang terbuat dari ubi kayu atau ketela rambat. Di beberapa daerah kue carang mas memiliki nama lain seperti grubi, walangan, kue kremes, sarang balam atau cakar ayam. Carang mas memiliki rasa manis yang berasal dari gula jawa yang juga berperan sebagai perekat serpihan satu sama lain. Tekstur nya renyah, krispi dan sedikit lengket. Kita bisa menemukan Carang mas di toko oleh-oleh atau di penjual jajanan pasar.', 'publish', '2018-04-03 14:13:04', '2018-04-03 14:13:04', NULL, 'Kue Carang Mas', 'Kue Carang Mas', 'kue,carang mas'),
(22, 'Cilung', 'cilung', 110, 3, 15, 'Cilung adalah sebutan dari aci digulung', 'Adakah yang tak kenal dengan camilan satu ini? Cilung adalah sebutan dari aci digulung. Aci dalam bahasa sunda adalah  tepung kanji atau sagu. Cilung merupakan sebuah nama jajanan khas indonesia yang banyak digemari masyarakat terutama anak-anak. Cilung dibuat dari bahan dasar aci seperti makanan pada umumnya yakni cimol, cireng, cilok dan lain sebagainya. Cilung banyak dijual di perkampungan dan di depan sekolah dasar yang pembelinya yang tak lain mulai dari kalangan anak-anak hingga kalangan orang tua. Rasanya gurih dan teksturnya kenyal karena terbuat dari tepung kanji. Setelah di goreng, cilung biasanya di lumuri dengan bumbu bubuk sebagai penyedap.', 'publish', '2018-04-03 14:28:40', '2018-04-03 14:28:40', NULL, 'Cilung SMPN 11 Tangerang', 'Cilung SMPN 11 Tangerang', 'cilung,aci,aci digulung,tangerang'),
(23, 'Cilor', 'cilor', 109, 3, 14, 'Cilor Pedas Makaroni Ngoceh adalah Cilok , Makaroni dan Telur', 'Cilor ini memiliki artian cilok telor, ternyata isiannya bukan hanya cilok aja tapi ada makaroni basahnya, membuat rasa cilornya semakin nikmat. Nah cara pembuatannya, cilok yang telah dipotong kecil-kecil, makaroni basah, telur dan garam diaduk menjadi 1, setelah itu di masak dalam loyang bulan kecil-kecil setelah matang diletakan pada mangkuk besar dan di beri bumbu pedas/baberque/asin sesuai selera kalian. Lalu di kocok hingga tercampur rata. Rasanya yummy banget cocok deh buat cemilan.', 'publish', '2018-04-03 14:44:18', '2018-04-05 21:15:49', '2018-04-05 21:15:49', 'Cilor Pedas Makaroni Ngoceh', 'Cilor Pedas Makaroni Ngoceh', 'Cilor,Cilor Pedas'),
(24, 'Tradisional', 'tradisional', 105, 1, 13, 'Apem panggangg adalah salah satu cemilan yang nusantara banget', 'dikenal dengan rasanya yang manis dan gurih, apem memiliki adonan khas yang hhanya bisa di buat dengan campuran santan didalam adonannya', 'publish', '2018-04-03 14:52:13', '2018-04-05 21:16:01', '2018-04-05 21:16:01', 'Apem', 'Apem Panggang', 'Apem,Apem Panggang,apem,apem pastellia,Apem Pastellia,Pastellia BSD,Pastellia Pasar Modern BSD'),
(25, 'Otak Otak', 'otak-otak', 111, 15, 14, 'Otak Otak Pedas Makaroni Ngoceh', 'Cemilan kali ini bukan sekedar otak-otak biasa, otak-otak ini cocok banget buat penyuka pedas, karna bisa sampe level pedes banget, buat yang ga suka pedes tenang aja disini juga tersedia bumbu baberque dan asin. Otak-otak ini dipotong kecil” lalu di goreng setelah matang otak-otaknya di letakan ke dalam wadah dan diisi bumbu sesuai keinginan kalian dan di kocok-kocok hingga bumbu menjadi satu dengan otak”. Enak banget deh buat cemilan nonton film.', 'publish', '2018-04-03 14:55:56', '2018-04-05 21:20:20', '2018-04-05 21:20:20', 'Otak Otak Pedas Makaroni Ngoceh', 'Otak Otak Pedas Makaroni Ngoceh', 'Otak otak,otak otak pedas,otak otak depok'),
(26, 'Pukis', 'pukis', 112, 16, 14, 'Pukis adalah sebuah kue khas Indonesia. Kue ini dibuat dari adonan telur, gula pasir, tepung terigu, ragi dan santan.', 'Kue basah ini sering banget kita temuin saat ada acara arisan,atau acara keluarga. Cemilan ini memiliki banyak rasa salah satunya yang coklat. Kuenya yang lembut dan rasanya yang enak bikin orang yang memakannya ketagihan loh. Dan yang paling penting cemilan ini cocok banget di minum dengan secangkir kopi ABC Susu. Perpaduan yang cocok bukan.', 'publish', '2018-04-03 15:17:21', '2018-04-05 21:16:14', '2018-04-05 21:16:14', 'Pukis Coklat Indo Mas', 'Pukis Coklat Indo Mas', 'pukis,pukis coklat,pukis serua'),
(27, 'Risol', 'risol', 113, 18, 14, 'Risol adalah pastri berisi daging, biasanya daging cincang, dan sayuran yang dibungkus dadar, dan digoreng setelah dilapisi tepung panir dan kocokan telur ayam.', 'Siapa sih yang ga tau risol? Risol bisa jadi salah satu cemilan yang bisa mengganjal lapar atau cemilan saat pagi hari. Risol ini banyak banget macam isiannya. Salah satunya risol ini yang memilki isian kentang,wortel dan buncis yang telah dipotong kecil-kecil. Ukurannya lumayan besar dan risol ini sangat lembut loh ketika digigit.', 'publish', '2018-04-03 15:36:12', '2018-04-05 21:16:21', '2018-04-05 21:16:21', 'Risol Indo Mas', 'Risol Indo Mas', 'Risol,Risol Depok'),
(28, 'Tahu Goreng', 'tahu-goreng', 114, 20, 14, 'Tahu Pedas adalah Tahu isi dengan adonan isiannya yang pedas', 'Siapa yang suka makan pedes ? Harus cobain tahu pedes satu ini guys. Tahu pedes ini diisi dengan sayur-sayuran yang telah di campur bumbu pedas lalu tahunya dilumuri adonan terigu dan digoreng hingga matang dan kering. Ukuran tahu pedas ini sendiri lumayan besar loh. Rasanya bener-bener enak untuk penyuka pedas .', 'publish', '2018-04-03 15:56:20', '2018-04-05 21:10:18', '2018-04-05 21:10:18', 'Tahu Pedas Reni Jaya', 'Tahu Pedas Reni Jaya', 'Tahu Pedas,Tahu Goreng,Gehu Pedas'),
(29, 'Arum Manis', 'arum-manis', 117, 1, 14, 'Arum Manis Toko Mama Indah', 'Back to zaman SD banget pasti kalian pernah dong makan jajanan yang berwarna warni berbahan dasar gula? Iyaps betul, arum manis namanya. Bentuknya lembut, panjang, layaknya orang menyebutnya dengan istilah lain yaitu rambut nenek. Camilan ini juga cocok untuk segala usia. Seakan ada magnet kebahagiaan bagi siapapun yang memakannya. Memiliki berbagai macam warna yang membuatnya semakin menarik. Biasanya cemilan ini terdapat dua kerupuk yang rasanya lebih gurih dan asin untuk menutupi bagian atas dan bawah. Lalu ditengahnya barulah diisi dengan si gula yang manis itu. Sebuah perpaduan rasa yang cocok abis jika kita sandingkan dengan segelas kopi mantap ABC susu.', 'publish', '2018-04-03 17:15:54', '2018-04-05 21:16:28', '2018-04-05 21:16:28', 'Arum Manis Toko Mama Indah', 'Arum Manis Toko Mama Indah', 'Arum Manis,Rambut nenek,Arum Manis tangsel'),
(30, 'Bika Ambon', 'bika-ambon', 118, 2, 14, 'Bika Ambon adalah sejenis penganan asal Indonesia. Terbuat dari bahan-bahan seperti telur, gula, dan santan, bika ambon umumnya dijual dengan rasa pandan, meskipun kini juga tersedia rasa-rasa lainnya seperti durian, keju, dan cokelat.', 'Bika Ambon merupakan kue khas yang berasal dari Medan. Walaupun begitu, penyebarannya sudah terkenal se-Nusantara. Bika Ambon merupakan kue berwarna kuning dengan tekstur yang legit dan berlubang-lubang di atasnya. Bahan utama dalam membuat cemilan ini adalah tepung sagu, kelapa, ragi, garam dan gula. Pada dasar nya, membuat Resep Bika Ambon Medan Panggang atau Kukus sama saja, cuma mungkin di tahap akhirnya yang sedikit berbeda. Satu perlu oven untuk memanggang dan satu lagi perlu di kukus dengan air mendidih dengan api sedang. Memakan bika ambon seakan ada rasa nagih terus menerus. Sebuah kenikmatan jika ditemani dengan secangkir kopi ABC susu.', 'publish', '2018-04-03 17:25:55', '2018-04-05 21:17:28', '2018-04-05 21:17:28', 'Bika Ambon Mama Indah', 'Bika Ambon Mama Indah', 'Bika Ambon,bika ambon tangsel'),
(31, 'Dadar Gulung', 'dadar-gulung', 119, 4, 14, 'dadar gulung merupakan penganan khas Indonesia dan Malaysia yang dapat digolongkan sebagai pancake yang diisi dengan parutan kelapa yang dicampur dengan gula jawa cair. Isi ini disebut unti.', 'Dadar gulung adalah salah satu resep kue basah tradisional yang terbuat dari bahan sederhana seperti tepung terigu, parutan kelapa, gula jawa, pandan.  Resep dadar gulung biasanya menggunakan pandan sebagai pewarna luarnya. Cara pembuatannya yaitu dua langkah dengan membuat kulit dadar gulung nya serta membuat isinya yang bisa disesuaikan dengan selera kita. Umumnya isian dari dadar gulung adalah parutan kelapa yang telah dicampur dengan gula aren. Saat digigit, kelembutan dari kulit pandan dan rasa manisnya sangat terasa. Terlebih lagi jika kita menikmatinya dengan secangkir kopi ABC susu.', 'publish', '2018-04-03 17:37:16', '2018-04-05 21:17:35', '2018-04-05 21:17:35', 'Dadar Gulung Mama Indah', 'Dadar Gulung Mama Indah', 'Dadar Gulung'),
(32, 'Dim Sum', 'dim-sum', 103, 4, 13, 'Dimsum enak dengan bahan seafood yang segar', 'Dim Sum adalah salah satu makanan yang cukup jadi favorit banyak kalangan, karena dim sum sendiri bukan kaegori makanan berat namun tidak terlalu ringan juga untuk di santap, memiliki berbagai macam varian yang ada dari mulai bakpao, hakau, dumpling, gyoza, dan siomai, sehingga membuat kita sendiri tidak bosan menikmatinya.', 'publish', '2018-04-03 18:11:16', '2018-04-05 21:11:22', '2018-04-05 21:11:22', 'Dimsum PASTELLIA BSD', 'Dimsum', 'Dimsum,Dimsum BSD,Pastellia'),
(33, 'Gethuk', 'gethuk', 106, 7, 13, 'Gethuk adalah salah satu cemilan yang sangat khas dari jawa tengah', 'Gethuk adalah salah satu cemilan yang sangat khas dari jawa tengah, yang terbuat dari olahan singkong dengan di taburi kelapa parut yang gurih, menambah cita rasa khas, dan juga cukup menggugah selera dengan warna-warni yang cukup menarik.', 'publish', '2018-04-03 21:23:18', '2018-04-05 21:17:22', '2018-04-05 21:17:22', 'Gethuk', 'Gethuk lindri', 'Gethuk,Gethuk lindri,Gethuk Pastellia,Gethuk BSD,Gethuk enak,gethuk enak,BSD'),
(34, 'Ketan Susu', 'ketan-susu', 107, 11, 13, 'Ketan susu ini memiliki rasa ketan yang hambar dengan tekstur yang sangat lembut namun rasanya semakin mantap ketika di lumuri dengan susu kental manis', 'Ketan susu ini memiliki rasa ketan yang hambar dengan tekstur yang sangat lembut namun rasanya semakin mantap ketika di lumuri dengan susu kental manis yang membuat rasanya semakin seimbang', 'publish', '2018-04-03 21:37:45', '2018-04-05 21:17:41', '2018-04-05 21:17:41', 'Ketan susu yang mulai terkenal karena', 'Ketan Susu', 'Ketan Susu,ketan susu,Ketan susu,Tansu,tansu,Ketan susu BSD'),
(35, 'Tahu Krispi', 'tahu-krispi', 121, 20, 15, 'Disajikan dengan tambahan bumbu dari berbagai jenis varian rasa akan buat sensasi seru di lidah.', 'Butuh camilan dan konsentrasi di sore hari cocok untuk menikmati Tahu Krispi sambil seduh Kopi ABC Susu. Kopi ABC Susu pasti membuat aktifitas lebih fokus dan tahu krispi bisa menambah konsentrasi dan perut terisi. Disajikan dengan tambahan bumbu dari berbagai jenis varian rasa akan buat sensasi seru di lidah. Dengan rasa tahu yang gurih sambil seruput hangatnya Kopi ABC Susu, hmm sedap! Soremu akan jadi semakin seru dengan Kopi ABC Susu.', 'publish', '2018-04-04 13:47:16', '2018-04-05 21:20:12', '2018-04-05 21:20:12', 'Tahu Krispi 49', 'Tahu Krispi 49', 'tahu,krispi,tahu krispi 49'),
(36, 'Cilok Goreng', 'cilok-goreng', 122, 3, 15, 'Cilok memiliki arti dari gabungan kata Aci yang dicolok, dan cilok yang satu ini cilok yang digoreng.', 'Cilok memiliki arti dari gabungan kata Aci yang dicolok, dan cilok yang satu ini cilok yang digoreng. Cilok goreng ini sangat cocok dengan Kopi ABC Susu menjadi perpaduan yang pas. Bisa disantap kapan saja apalagi untuk momen nyemil bareng keluarga. Anda bisa menikmati cilok goreng ini yang disajikan dengan rasa yang asin nan gurih, dan hangatnya Kopi ABC Susu yang rasanya mantap! Momen ceria bareng keluarga pun akan semakin hangat sambil nikmatin Kopi ABC Susu rame-rame.', 'publish', '2018-04-04 14:09:22', '2018-04-05 21:20:35', '2018-04-05 21:20:35', 'Cilok Goreng 49', 'Cilok Goreng 49', 'cilok,goreng,tahu krispi 49,cilok goreng'),
(37, 'Hunkwe', 'hunkwe', 123, 8, 14, 'Hunkwe Mutiara Toko Mama Indah', 'Hunkwe merupakan makanan yang termasuk dalam golongan jenis kue basah yang banyak diminati. Dengan memiliki tekstur yang sangat halus dan lembut juga sedikit kenyal, dan terdapat berbagai macam varian warna yang unik. Makanan ini dapat anda jadikan sebagai cemilan, bagi semua jenis kalangan. Bahan yang digunakan diantaranya sagu mutiara, tepung hunkwe, santan kelapa, gula pasir dan garam. Sajikan selagi dingin. Jangan lupa ditemani secangkir kopi ABC susu!', 'publish', '2018-04-04 16:43:00', '2018-04-05 21:17:49', '2018-04-05 21:17:49', 'Hunkwe Mutiara Toko Mama Indah', 'Hunkwe Mutiara Toko Mama Indah', 'HUnkwe,hunkwe mutiara'),
(38, 'Gabin', 'gabin', 150, 7, 14, 'Gabin Isi Telur di Pasar Geger Kalong', 'Semua pasti tidak asing dengan roti gabin,nah saat ini banyak inovasi yang dibuat. Salah\r\nsatunya yaitu gabin isi telur. Cemilan ini terbuat dari gabin yang diisi dengan adonan pastel dan ditambahkan potongan dari telur rebus. Lalu digoreng hingga garing. Cemilan ini paling enak dinikmati dengan minum kopi. Jajanan ini sangat mudah ditemui tentunya.\r\n\r\nOpen : 06.00-14.00', 'publish', '2018-04-05 10:59:04', '2018-04-05 21:20:41', '2018-04-05 21:20:41', 'Gabin Isi Telur Gegerkalong', 'Gabin Isi Telur Gegerkalong', 'Gabin,Gabin isi telur,gabin gegerkalong'),
(39, 'Takoyaki', 'takoyaki', 145, 20, 14, 'Takoyaki di Gegerkalong Tengah', 'Takoyaki ini terbuat dari tepung terigu yang didalamnya juga terdapat bumbu-bumbu\r\nseperti daun bawang dan isian yang kita mau misalnya seefood. Bentuk dari makanan ini seperti bola kecil, takoyaki sangat popiler di Jepang,karan makanan satu ini adalah cemilan khas jepang. Takoyaki biasa dijual dalam bentuk set dengan 1 set berisi 5, 6, 8 hingga 10 buah.', 'publish', '2018-04-05 11:13:51', '2018-04-05 21:20:47', '2018-04-05 21:20:47', 'Takoyaki Gegerkalong', 'Takoyaki Gegerkalong', 'takoyaki,takoyaki gegerkalong,takoyaki bandung'),
(40, 'Putu Ayu', 'putu-ayu', 144, 16, 14, 'Putu Ayu di Pasar Geger Kalong', 'Kue putu ayu merupakan kue tradisional asli indonesia,kue putu ayu ialah salah satu koleksi dari kue jajanan pasar yang di miliki oleh indonesia.Putu ayu memiliki nama yang hampir sama dengan kue putu,namun sebenarnya bahan dasar untuk pembuatan kue putu ayu s berbeda dengan kue putu yang hanya menggunakan tepung beras untuk adonannya. Dalam pembuatan kue putu ayu biasanya menggunakan beberapa bahan yang biasa di gunakan untuk membuat bolu kukus.persamaan dari kedua kue ini hanyalah pada pemakaian kelapa sebagai hiasannya. Kelapa dalam kue putu ayu juga\r\ndijadikan sebagai toping dari kue ini.', 'publish', '2018-04-05 11:21:49', '2018-04-05 21:11:36', '2018-04-05 21:11:36', 'Putu Ayu Pasar Geger Kalong', 'Putu Ayu Pasar Geger Kalong', 'putu ayu,putu ayu gegerkalong,putu ayu bandung'),
(41, 'Bacang', 'bacang', 140, 2, 14, 'Bacang di Borma Setiabudhi', 'Bacang beras merupakan penganan tradisional masyarakat Cina Tiongkok yang dibungkus dengan daun bambu yang berisi beras dengan campuran daging dan berbentuk limas segitiga. Paling enak dimakan ketika masih panas. Bacang dibuat dari beras ketan sebagai lapisan luar, daging, jamur, udang kecil, seledri, dan jahe sebagai isi. Ada juga yang menambahkan kuning telur asin. Untuk perasa biasanya ditambahkan sedikit garam, gula, merica, penyedap makanan, kecap, dan sedikit minyak nabati.', 'publish', '2018-04-05 11:28:07', '2018-04-05 21:20:53', '2018-04-05 21:20:53', 'Bacang Daging Borma', 'Bacang Daging Borma', 'bacang,bacang daging,bacang borma,bacang bandung'),
(42, 'Ali Agam', 'ali-agam', 135, 1, 14, 'Ali Agam di Pasar Gegerkalong', 'Ali agam merupakan jajanan yang saat ini jarang atau susah ditemui, tapi masi menjadi\r\njajanan favorit untuk teman ngopi atau nge-teh. Jajanan ini biasanya banyak terdapat di pasar tradisional. Rasanya tidak kalah enak dengan jajanan pada saat sekarang ini. Jajanan ini terbuat dari tepung beras dan gula merah.', 'publish', '2018-04-05 11:34:00', '2018-04-05 21:21:34', '2018-04-05 21:21:34', 'Ali Agam Pasar Gegerkalong', 'Ali Agam Pasar Gegerkalong', 'Ali Agam,Ali Agam gegerkalong,ali agam bandung'),
(43, 'Apem', 'apem', 138, 1, 14, 'Apem Nasi Pelangi di Pasar Gegerkalong', 'Apem nasi pelangi ini rasanya sama kaya apem pada umumnya cuma bentuknya aja yang beda, bentuknya hampir mirip kue mangkok. Satu box isinya 6 (2 pink, 2 putih, dan 2 hijau) tapi walaupun warna-warni, rasanya sama aja kok semuanya. Makan apem pelangi ini terus minumnya kopi ABC susu itu enak banget loh!', 'publish', '2018-04-05 11:50:16', '2018-04-05 21:21:28', '2018-04-05 21:21:28', 'Apem Nasi Pelangi Gegerkalong', 'Apem Nasi Pelangi Gegerkalong', 'apem,apem nasi pelangi,apem gegerkalong'),
(44, 'Bangket', 'bangket', 139, 2, 14, 'Bangket keju Di Rotiku Setiabudi', 'Kue bangket keju ini cukup unik karena ada perpaduan dari rasa jahe, kayu manis, dan keju yang ditabur diatasnya. Aromanya jahe dan kayu manis banget deh. Untuk teksturnya sendiri bisa dibilang unik karena ngembang dan ‘retak-retak’. Kue ini paling enak dinikmatin selagi hangat dan minumnya kopi ABC susu!', 'publish', '2018-04-05 12:09:22', '2018-04-05 21:21:18', '2018-04-05 21:21:18', 'Bangket Keju Rotiku', 'Bangket Keju Rotiku', 'Bangket keju,bangket keju bandung'),
(45, 'Bakpao', 'bakpao', 142, 2, 14, 'Bakpao kacang Hijau di Borma Setiabudi', 'Bosen sama bakpao yang isinya cokelat? Bakpao ini isinya kacang hijau dan adonannya yang unik karena berwarna pink (merah muda). Makan bakpao ini enaknya saat masih panas supaya kacang hijau yang didalamnya jadi tambah lembut ketika dimakan bareng kopi ABC susu!', 'publish', '2018-04-05 12:17:10', '2018-04-05 21:21:11', '2018-04-05 21:21:11', 'Bakpao kacang Hijau Borma', 'Bakpao kacang Hijau Borma', 'Bakpao,Bakpao kacang hijau,bakpao bandung'),
(46, 'Bolu', 'bolu', 143, 2, 14, 'Bolu Agar Agar', 'Bolu agar-agar ini unik banget, lho! Karena terdiri dari 3 lapisan, yaitu lapisan atasnya agar-agar, lapisan tengahnya seperti kocokan putih telur, dan lapisan terakhir alias lapisan yang bawah adalah bolunya yang lembut. Sensasinya beda banget kalo kita makan bolu ini dibanding dengan bolu biasanya, karena 3 perpaduan unik itu. Ngemil bolu ini paling enak kalo sambil ngopi ABC susu!', 'publish', '2018-04-05 12:28:09', '2018-04-05 21:21:02', '2018-04-05 21:21:02', 'Bolu Agar Agar Rotiku', 'Bolu Agar Agar Rotiku', 'bolu,bolu agar agar'),
(47, 'Bakpia', 'bakpia', 137, 2, 14, 'Bakpia Coklat Di Borma Setiabudi', 'Kue Pia adalah salah satu cemilan yang disukai hampir seluruh masyarakat Indonesia. Pia\r\nCoklat ini memiliki cita rasa yang enak dan lezat, rasanya yang legit dengan bahan-bahan\r\nberkualitas dan harum yang khas, tercium dari bakpia ini. Ditambah dengan rasa coklat yang membuat rasanya semakin lezat, apalagi jika dinikmati pada saat masih dalam keadaan hangat. Pia ini bisa menemani anda selagi anda mengobrol dengan teman-teman ada anda.', 'publish', '2018-04-05 12:50:25', '2018-04-05 21:19:44', '2018-04-05 21:19:44', 'Bakpia Coklat Borma Setiabudi', 'Bakpia Coklat Borma Setiabudi', 'Bakpia,bakpia coklat,bakpia bandung'),
(48, 'Gemblong', 'gemblong', 149, 7, 14, 'Gemblong adalah sejenis makanan tradisional atau kue tradisional Indonesia yang termasuk ke dalam kelompok jajanan pasar.', 'Gemblong merupakan sejenis makanan tradisional atau kue tradisional Indonesia yang\r\ntermasuk ke dalam kelompok jajanan pasar. Gemblong terbuat dari adonan tepung beras\r\nketan putih dan dibentuk bulat seperti bola kemudian adonan gemblong yang sudah dibentuk bulat digoreng dan dilapisi dengan larutan gula aren. Di daerah Jawa Timur gemblong dikenal dengan nama Getas. Gemblong sangat cocok untuk dinikmati sambil minum kopi di pagi hari ataupun sore hari.', 'publish', '2018-04-05 13:20:11', '2018-04-05 21:19:35', '2018-04-05 21:19:35', 'Gemblong Gegerkalong', 'Gemblong Gegerkalong', 'Gemblong,gemblong gegerkalong'),
(49, 'Cikak', 'cikak', 133, 3, 14, 'Cikak adalah camilan yang memiliki bentuk unik yakni berbentuk buah buahan.', 'Cikak adalah camilan yang memiliki bentuk unik yakni berbentuk buah buahan. Camilan ini terbuat dari tepung beras ketan yang kemudian dilapisi lagi dengan agar agar bening, tekstur dari cikak ini sangat Kenyal dan cikak juga memiliki isian yakni adonan kacang hijau yang memiliki rasa yang manis saat dimakan', 'publish', '2018-04-05 13:31:38', '2018-04-05 13:31:38', NULL, 'Cikak Setiabudhi', 'Cikak Setiabudhi', 'Cikak,Cikak setiabudhi'),
(50, 'Koci Koci', 'koci-koci', 134, 11, 14, 'Koci Koci adalah salah satu nama kue tradisional asli Indonesia yang sampai saat ini masih banyak digemari oleh semua orang', 'Koci koci adalah camilan tradisional yang memiliki rasa unik sesuai dengan namanya. Berbentuk segitiga dan dibungkus oleh daun pisang koci koci memiliki rasa yang enak dan manis. Saat disantap rasa dari camilan ini akan terasa perpaduan antara ketan dan santan di bagian luar serta parutan kelapa muda di bagian dalam', 'publish', '2018-04-05 14:22:25', '2018-04-05 21:18:16', '2018-04-05 21:18:16', 'Koci Koci', 'Koci Koci', 'Koci,koci koci'),
(51, 'Srikaya Pandan', 'srikaya-pandan', 146, 19, 14, 'Srikaya Pandan adalah camilan yang manis dan berwarna hijau yang dimana\r\nditempatkan di mangkuk kecil/ wadah kecil.', 'Srikaya Pandan adalah camilan yang manis dan berwarna hijau yang dimana\r\nditempatkan di mangkuk kecil/ wadah kecil. Rasa dari Srikaya Pandan ini manis,\r\nmemiliki aroma pandan yang kuat dan kenyal, Bentuknya yang kenyal serupa dengan\r\nagar agar namun Srikaya memiliki tekstur berongga.', 'publish', '2018-04-05 14:36:19', '2018-04-05 21:18:00', '2018-04-05 21:18:00', 'Srikaya Pandan', 'Srikaya Pandan', 'Srikaya,srikaya pandan'),
(52, 'Otok Owo', 'otok-owo', 147, 15, 14, 'Otok Owo adalah camilan tradisional yang berbentuk kue kering berwarna coklat dan\r\nberbentuk lingkaran.', 'Otok Owo adalah camilan tradisional yang berbentuk kue kering berwarna coklat dan\r\nberbentuk lingkaran. Kue ini memiliki perpaduan rasa yang unik, yakni manis yang\r\nberasal dari gula jawa, setelah disantap akan terasa asin dan hangat yang berasal dari\r\njahe.', 'publish', '2018-04-05 14:41:27', '2018-04-05 21:18:08', '2018-04-05 21:18:08', 'Otok Owo', 'Otok Owo', 'Otok Owo,Otok Owo bandung'),
(53, 'Ketan', 'ketan', 153, 11, 15, 'KETAN bisa juga lho jadi camilan yang gurih dan mantap.', 'KETAN bisa juga lho jadi camilan yang gurih dan mantap.', 'publish', '2018-04-05 15:18:18', '2018-04-05 21:12:14', '2018-04-05 21:12:14', 'Camilan Ketan', 'Cemilan Ketan', 'ketan,serundeng,susu'),
(54, 'Bola-Bola Oreo', 'bola-bola-oreo', 157, 2, 19, 'Bola-Bola Oreo adalah camilan yang kekinian.', 'Bola-Bola Oreo adalah camilan yang kekinian, bola bola oreo ini memiliki banyak varian rasa juga, mulai dari oreo, green tea, vanilla dan lainnya. Untuk rasanya udah pasti enak banget! Karena rasa dari bola bola oreo ini manis susu namun di dalamnya ada crunchy biscuit dan juga tidak ketinggalan ada taburan oreo di seluruh permukaan bola bola oreo ini yang saat disantap akan menambahkan rasa enaknya', 'publish', '2018-04-06 01:16:07', '2018-04-06 01:17:03', NULL, 'Kue', 'Kue Kering', 'kue kering,kue,cemilan,bola-bola oreo'),
(55, 'Ape', 'ape', 166, 1, 14, 'Kue Ape adalah merupakan jajanan khas dari Jakarta. Bentuknya menyerupai pancake.', 'Kue Ape ini salah satu jajanan tradisional yang banyak di gemari oleh masyarakat indonesia loh. Selain bentuknya yang unik rasanya pun enak banget, apalagi dimakan saat pagi hari yang cerah ditemani dan secangkir mantapnya paling nikmat Kopi ABC Susu. Kolaborasi yang paling mantap untuk menemani pagi yang cerah ini guys.', 'publish', '2018-04-06 21:59:21', '2018-04-06 21:59:21', NULL, 'Kue Ape', 'Kue Ape', 'Kue ape,kue ape jakarta'),
(56, 'Cucur', 'cucur', 167, 3, 14, 'Kue Cucur adalah salah satu jajanan tradisional di Indonesia', 'Siapa hayo yang belum tau cemilan tradisional satu ini? Ini adalah kue cucur. Kue cucur ini terbuat dari tepung beras dan gula aren yang digoreng. Teman pagiku bersama kue cucur yang gurih dan manis dilengkapi dengan kopi ABC Susu membuat pagiku', 'publish', '2018-04-06 22:26:27', '2018-04-06 22:26:27', NULL, 'Kue Cucur', 'Kue Cucur', 'Kue Cucur'),
(57, 'Kuping Gajah', 'kuping-gajah', 168, 11, 14, 'Kue kuping gajah merupakan salah satu kue tradisional asli Indonesia. Memiliki bentuk yang unik serta rasa yang manis, enak dan renyah', 'Nah ini namanya unik baget nih, Kuping Gajah. Tapi bukan kuping gajah beneran ya guys. Ini Cuma sebutan aja karna bentuk dari kripik ini mirip banget sama kuping gajah. Kripik kuping gajah ini renyah banget rasanya yang manis cocok banget dimakan bareng secangkir hangatnya kopi ABC Susu. Enak banget nih buat cemilan sore hari apalagi di saat mendung begini.', 'publish', '2018-04-07 19:40:32', '2018-04-07 19:40:32', NULL, 'Kuping Gajah Musyawarah', 'Kuping Gajah Musyawarah', 'Kuping Gajah ,Kuping Gajah Jakarta'),
(58, 'Soes', 'soes', 169, 19, 13, 'Soes adalah makanan yang menarik, dengan bahan roti kering yg gurih, dan isian fla lembut yang manis.', 'Soes kali ini bisa kamu dapatkan di toko kue mayestik di daerah ciputat, dengan bahan roti kering yg gurih, dan isian fla lembut yang manis, kue yang sudah melegenda di indonesia ini digemari banyak kalangan dari tua hingga muda, karena memang tergolong salah satu cemilan andalan yang ringan dan cocok sebagai teman kopi.', 'publish', '2018-04-08 16:31:39', '2018-04-08 16:31:39', NULL, 'Soes Mayestik', 'Kue Soes', 'Kue Soes,kue sus,Soes,sus,Mayestik,ciputat'),
(59, 'Apem panggang', 'apem-panggang', 105, 1, 13, 'Apem panggangg adalah salah satu cemilan yang nusantara banget, dikenal dengan rasanya yang manis dan gurih, apem memiliki adonan khas yang hanya bisa di buat dengan campuran santan didalam adonannya.', 'Apem panggangg adalah salah satu cemilan yang nusantara banget, dikenal dengan rasanya yang manis dan gurih, apem memiliki adonan khas yang hhanya bisa di buat dengan campuran santan didalam adonannya, santan itu sendiri memunculkan rasa yang unik dan sangat nikmat di nikmati untuk cemilan atau teman santai sambil ngopi, tentunya bakal lebih mantap jika kopinya kopi ABC Susu.', 'publish', '2018-04-08 16:36:31', '2018-04-08 16:36:31', NULL, 'Apem panggang', 'Apem panggang', 'apem,panggang,apem panggang,Apem,Panggang,Apem Panggang,BSD'),
(60, 'Gethuk', 'gethuk', 106, 7, 13, 'Gethuk adalah salah satu cemilan yang sangat khas dari jawa tengah, yang terbuat dari olahan singkong dengan di taburi kelapa parut yang gurih', 'Gethuk adalah salah satu cemilan yang sangat khas dari jawa tengah, yang terbuat dari olahan singkong dengan di taburi kelapa parut yang gurih, menambah cita rasa khas, dan juga cukup menggugah selera dengan warna-warni yang cukup menarik, biasanya didaerah asal gethuk ini digunakan sebagai cemilan teman ngopi, yang artinya biasanya makanan ini cocok dinikmati di pagi atau sore hari ketika waktu istirahat setelahh beraktifitas. hmmm.. kalau teman ngopi, berarti cemilan ini sudah dipastikan cocok dan makin mantap nih disantap bersama kopi ABC Susu.', 'publish', '2018-04-08 16:39:27', '2018-04-08 16:39:27', NULL, 'Gethuk', 'Gethuk', 'gethuk,Gethuk,gethuk BSD,pastellia,Pastellia,Gethuk Pastellia BSD,gethuk pastellia bsd'),
(61, 'Rogut ayam', 'rogut-ayam', 170, 18, 13, 'Rogut ayam merupakan cemilan berbahan dasar ayam, sayur mayur, mayonaise, dan terkadang menggunakan keju, dengan bahan kulit yang lembut yang berbalut tepung panir.', 'Rogut ayam merupakan cemilan berbahan dasar ayam, sayur mayur, mayonaise, dan terkadang menggunakan keju, dengan bahan kulit yang lembut yang berbalut tepung panir, membuat rasa dari rogut semakin menarik untuk di nikmati. krispi di luar, lembut dan lumer di dalam, itulah ciri khas Rogut yang di sediakan oleh toko cemilan Pasmod Bintaro, sehingga membuat cemilan ini semakin mantap di santap dengan cabai rawit yang pedas, dan di sandingkan dengan Kopi ABC susu', 'publish', '2018-04-08 16:48:47', '2018-04-08 16:48:47', NULL, 'Rogut ayam', 'Rogut Ayam', 'rogut ayam,Rogut Ayam,Rogut,Pasmod Bintaro'),
(62, 'Schotel Makaroni ayam', 'schotel-makaroni-ayam', 171, 19, 13, 'Schotel makaroni ayam dengan campuran keju yang lembut ini dijamin bikin kamu ga akan bisa berpaling hanya dengan satu suapan.', 'Schotel makaroni ayam dengan campuran keju yang lembut ini dijamin bikin kamu ga akan bisa berpaling hanya dengan satu suapan. Kenapa? karena jika biasanya adonan makaroni dan ayamnya di aduk menjadi satu, kali ini kamu bakal menemukan sensasi yang beda dari schotel lain, karena di schotel kali ini, kamu akan menemukan layer yang berbeda di setiap suapan.', 'publish', '2018-04-08 17:11:17', '2018-04-08 17:11:17', NULL, 'Schotel makaroni ayam', 'Schotel makaroni ayam', 'schotel,Schotel,Schotel makaroni ayam,schotel makaroni ayam,makaroni,Pasmod Bintaro,pasmod bintaro'),
(63, 'Onggol-ongol', 'onggol-ongol', 172, 15, 13, 'Penganan satu ini memiliki ciri yang cukup khas yaitu tekstur yang lembut dan sedikit kenyal, dengan taburan kelapa yang membuat nya semakin seimbang antara rasa manis dari kuenya, dan gurih dari santan.', 'Penganan satu ini memiliki ciri yang cukup khas yaitu tekstur yang lembut dan sedikit kenyal, dengan taburan kelapa yang membuat nya semakin seimbang antara rasa manis dari kuenya, dan gurih dari santan. Ongol-ongol namanya, cemilan ini biasanya memiliki  jenis adonan yang berbeda, yg sangat banyak di jajakan di jawa barat khususnya jakarta adalah menggunakan bahan tepung sagu, namun di Jawa Tengah dan Jawa Timur, Ongol-ongol sendiri menggunakan singkong sebagai bahan dasarnya. sehingga kamu tidak bosan untuk menikmatinya dengan dua varian yang berbeda untuk teman kopimu, pasti lebih mantap.', 'publish', '2018-04-08 18:01:08', '2018-04-08 18:01:08', NULL, 'Ongol-ongol', 'Ongol-ongol', 'ongol-ongol,Ongol-Ongol,Ongol-ongol,Ongol-ongol Pastellia BSD,pastellia,BSD'),
(64, 'Onde-onde', 'onde-onde', 158, 15, 13, 'Bulat, renyah, kejutan di dalam, dan bertabur wijen. Yap ini dia Onde-onde!', 'Bulat, renyah, kejutan di dalam, dan bertabur wijen. Yap ini dia Onde-onde! Onde-onde merupakan jajanan khas dari daerah Mojokerto. Namun karena Onde-onde disukai orang Indonesia dari berbagai daerah, kita bisa menemukan Onde-onde di mana saja.', 'publish', '2018-04-08 21:52:22', '2018-04-08 21:52:22', NULL, 'Onde-onde', 'Onde-onde', 'Onde-onde Verina,onde onde verina,Verina Kue & snack'),
(65, 'Brownies', 'brownies', 159, 2, 13, 'Cokelat kehitaman, padat, dan manis. Apalagi kalau bukan brownies?', 'Cokelat kehitaman, padat, dan manis. Apalagi kalau bukan brownies? Yap! Kue satu ini memang sebenarnya bukan asli dari Indonesia. Namun, karena digemari oleh masyarakat Indonesia, muncullah inovasi-inovasi yang diterapkan pada brownis.', 'publish', '2018-04-08 21:59:56', '2018-04-08 21:59:56', NULL, 'Brownies', 'Brownies Coklat', 'brownies,kue kering,enak,mantap'),
(66, 'Cheese Roll', 'cheese-roll', 162, 3, 13, 'Untuk kalian pecinta keju, pasti jajanan satu ini tidak akan asing.', 'Ya, Cheese Roll! Meskipun dikatakan bahwa Cheese Roll merupakan makanan yang populer di New Zealand, tapi Cheese Roll khas nusantara juga Indonesia punya lho. Di mana lagi kalau bukan di daerah Bandung, Jawa Barat. Olahan keju yang digulung dengan lapisan adonan roti dan dipanggang hingga kering ini juga digemari masyarakat Indonesia.', 'publish', '2018-04-08 22:19:19', '2018-04-08 22:19:19', NULL, 'Cheese Roll', 'Cheese Roll', 'Cheese Roll,cheese roll,keju,bandung'),
(67, 'balok', 'balok', 163, 2, 13, 'Kue Balok merupakan jajanan dikenal sejak tahun 1990an, tapi kembali tenar baru-baru ini. Jajanan khas dari daerah Jawa Barat ini disebut-sebut sebagai kembaran dari kue pukis karena memiliki rasa serta bentuk yang mirip.', 'Kue Balok merupakan jajanan dikenal sejak tahun 1990an, tapi kembali tenar baru-baru ini. Jajanan khas dari daerah Jawa Barat ini disebut-sebut sebagai kembaran dari kue pukis karena memiliki rasa serta bentuk yang mirip. Kue Balok kembali tenar dengan varian rasa serta topping yang lebih beragam, dari  green tea, tiramisu, coklat, nutella, dan masih banyak lagi. Selain itu kita juga bisa memilih ingin membeli Kue Balok yang matang atau setengah matang. Kue Balok pas menjadi teman ngobrol bersama teman-teman dan ditemani secangkir Kopi ABC Susu!', 'publish', '2018-04-08 22:33:57', '2018-04-08 22:33:57', NULL, 'Kue balok', 'Kue Balok', 'Kue balok,Balok,Kue,Bandung,Kue Balok Bandung'),
(68, 'Dadar Gulung', 'dadar-gulung', 164, 4, 15, 'Berwarna hijau dan manis di dalam. Apakah itu? Ya, dadar gulung.', 'Berwarna hijau dan manis di dalam. Apakah itu? Ya, dadar gulung. Dadar Gulung adalah salah satu makanan khas Indonesia yang berasal dari Pulau Jawa. Jajanan tradisional ini  terbuat dari tepung beras dan campuran pandan sebagai kulit, serta parutan kelapa dan gula merah, kemudian digulung.', 'publish', '2018-04-08 22:42:11', '2018-04-09 12:54:05', NULL, 'Dadar Gulung', 'Dadar Gulung', 'Dadar Gulung,dadar gulung,DarLung,Darlung,darlung,Bandung'),
(69, 'Nagasari', 'nagasari', 185, 14, 14, 'Nagasari adalah sejenis kue yang terbuat dari tepung beras, tepung sagu, santan, dan gula yang diisi pisang', 'Hallo, Mungkin kalian sering sekali melihat jajanan pasar yang satu ini namun jarang ada yang tau nama asli camilan tersebut. Nagasari, jajanan yang terbuat dari tepung beras dan santan ini memiliki tekstur yang lembut dan meleleh ketika dimakan. Isian pisang pada nagasari memberikan rasa manis alami dan menabah kesan tersendiri saat memakanya. Perpaduan tepung beras, santan dan isian pisang membuat', 'publish', '2018-04-08 23:43:00', '2018-04-08 23:43:00', NULL, 'Nagasari', 'Nagasari', 'Nagasari'),
(70, 'Otak-Otak', 'otak-otak', 189, 15, 14, 'Otak Otak Crispy ini adalah otak otak yang di balut oleh tepung kanji sehingga menghasilkan crispy diluarnya', 'Cemilan yang satu ini namanya Otak-Otak Crispy, cemilan yang satu ini emang renyah banget sih apalagi kalau dimakannya pas anget-anget, beuh..rasanya sama aja kaya otak-otak pada umumnya yang di goreng bedanya otak-otak ini di balut dengan tepung super renyah dengan warna yang super menggoda. Otak-otak ini pas banget kalo dimakannya pake saus sambal ditambah minumnya yang pasti kopi susu ABC dong~', 'publish', '2018-04-09 11:06:42', '2018-04-09 11:06:42', NULL, 'Otak-Otak', 'Otak-Otak', 'otak-otak,otak-otak crispy'),
(71, 'Bakwan', 'bakwan', 190, 2, 14, 'Bakwan adalah makanan gorengan yang terbuat dari sayuran dan tepung terigu yang lazim ditemukan di Indonesia.', 'Bakwan sayur dan bakwan jagung ini selain mengenyangkan bakwan ini sangat sehat untuk nutrisi kebutuhan setiap hari. Apalagi ditemani dengan kopi ABC Susu yang mantap rasa susunya. Bakwan sayur dan bakwan jagung ini rasanya renyah dan lembut di dalam. Cocok deh buat ganjel perut kamu kalo lagi lapar.', 'publish', '2018-04-09 11:22:22', '2018-04-09 11:22:22', NULL, 'Bakwan', 'Bakwan', 'Bakwan'),
(72, 'Bakso Goreng', 'bakso-goreng', 191, 2, 14, 'Bakso goreng atau yang biasa di sebut Basreng, ini adalah bakso yang di goreng hingga kering.', 'Cemilan yang satu ini namanya ‘Basreng’. Cemilan yang digemari berbagai kalangan ini eksis dimana-mana lho! Jika kita biasanya makan bakso yang di campur kuah, kali ini baksinya digoreng mengguakan tepung krispi. Rasanya yang gurih apalagi dicampur oleh berbagai bumbu seperti rasa barbeque, manis, asin, pedas dan keju menambah kenikmatan basreng ini. Cemilan ini akan semakin nikmat jika di makannya bersama Kopi Susu ABC sebagai minumannya lho teman-teman.', 'publish', '2018-04-09 11:41:32', '2018-04-09 11:41:32', NULL, 'Bakso Goreng', 'Bakso Goreng', 'Bakso,bakso goreng'),
(73, 'French fries', 'french-fries', 192, 6, 14, 'French fries adalah hidangan yang dibuat dari potongan-potongan kentang yang digoreng dalam minyak goreng panas.', 'Siapa sih yang gak tau cemilan yang satu ini. Cemilan French fries ini banyak banget diminati berbagai kalangan, kentang goreng yang satu ini rasanya renyah banget dan yang pasti enak banget. Kentang goreng ini di sajikan dalam keadaan masih hangat dan di goreng sangat garing. Jangan lupa cocol dengan sausnya.', 'publish', '2018-04-09 12:28:53', '2018-04-09 12:39:32', NULL, 'Kentang Goreng', 'Kentang Goreng', 'kentang,kentang goreng'),
(74, 'Donat', 'donat', 193, 4, 14, 'Donat adalah salah satu cemilan tradisolnal yang masih di gemari saat ini . Kue donat ini tengahnya bolong dan teksturnya lembut.', 'Kalian tau gak kalo salah satu makanan khas Indonesia ini udah ada sebelum nama Jakarta menjadi Batavia. Namanya Donat Cincin. Donat cincin ini mempunyai rasa manis yang diberikan dari gula halus yang dicampur dengan diluar donatnya. Tekstur yang donat ini lembut apalagi kalau disajikannya saat panas-panas atau baru matang. Donat ini cocok banget buat cemilan di pagi atau sore hari saat hujan turun apalagi makanannya di temennin sama seduhhan kopi susu abc yang rasa manisnya pas banget.', 'publish', '2018-04-09 13:28:54', '2018-04-09 13:28:54', NULL, 'Donat', 'Donat', 'Donat,Donat kentang'),
(75, 'Gemblong', 'gemblong', 194, 7, 15, 'Olahan ketan yang dibalut gula satu ini termasuk cemilan yang banyak digemari oleh masyarakat Indonesia', 'Olahan ketan yang dibalut gula satu ini termasuk cemilan yang banyak digemari oleh masyarakat Indonesia', 'publish', '2018-04-09 13:50:47', '2018-04-09 13:50:47', NULL, 'Gemblong', 'Gemblong Olahan Ketan', 'gemblong,ketan gula'),
(76, 'Klepon', 'klepon', 238, 11, 15, 'Klepon adalah cemilan yang terbuat dari tepung beras yang berisi lelehan gula merah', 'Klepon adalah cemilan yang terbuat dari tepung beras yang berisi lelehan gula merah', 'publish', '2018-04-09 15:01:54', '2018-04-09 15:01:54', NULL, 'Klepon', 'Klepon', 'klepon');
