(77, 'Putu', 'putu', 221, 16, 14, 'Kue putu adalah jenis makanan Nusantara berupa kue yang berisi gula jawa dan parutan kelapa, tepung beras butiran kasar', 'Hallo, kalian tau ga sih kalo putu adalah salah satu makanan khas jawa loh. Putu merupakan salah satu cemilan yang berbahan dasar tepung beras, gula merah dan parutan kelapa. Cara pembuatannya juga sangat seserhana hanya dengan di kukus dalam kurang lebih 15 menit kalian bisa langsung menikmati putu tanpa harus menunggu lama.', 'publish', '2018-04-09 15:09:15', '2018-04-09 15:09:15', NULL, 'Kue Putu', NULL, 'Kue Putu,Putu jakarta');
