(6, 54, 6, 'Tahu Bulat Ciputat', 'tahu bulat ciputat jakarta indonesia', NULL, 'tahu, bulat,tahu bulat', 'tahu-bulat-ciputat', '500', '<p>Kalian semua pasti mengenal atau sangat familiar dengan makanan yang satu ini. Ya betul sekali tahu bulat, mungkin saat ini Anda bisa dengan mudah menemukan tahu bulat, karena camilan populer ini mulai dijajakan keliling ke kampung hingga di tengah kota besar menggunakan mobil, dengan iringan musik khas yang pastinya menarik perhatian. Dengan rasa nya yang cukup gurih dan sedikit asin, sangat cocok sekali jika dimakan dengan ditemani Kopi ABC susu.</p>', 'Dengan rasa nya yang cukup gurih dan sedikit asin, sangat cocok sekali jika dimakan dengan ditemani Kopi ABC susu.', 3.00, 1, 'publish', 'Noviar Widodo', 1, '2018-03-28 14:44:00', '2018-04-02 14:01:32', '2018-04-02 14:01:32'),
(7, 60, 7, 'Tempe Mendoan Pertigaan Reni', NULL, NULL, 'Tempe,Tempe mendoan,mendoan', 'tempe-mendoan-pertigaan-reni', '2500', '<p>Tempe Mendoan Khas Cirebon ini sangat cocok di makan saat hujan atau cuaca dingin karna tempe mendoan baru akan di goreng saat ada pembeli , apalagi ditemani kopi ABC susu hangat pasti lebih nikmat. Ukuran tempe mendoan ini lumayan besar. Untuk rasanya sendiri sangat enak apalagi dimakan selagi hangat.</p>\r\n<p>Jam Buka : 18.00 - 23.00</p>', 'Tempe Mendoan Pertigaan Reni', 0.00, 14, 'publish', 'Julius Subang', 1, '2018-03-29 18:33:12', '2018-04-05 21:31:39', '2018-04-05 21:31:39'),
(8, 62, 10, 'Tahu Bulat', 'Tahu Bulat Pesanggrahan', 'Tahu berbentuk Bulat Yang hits', 'tahu,bulat,hits,pesanggrahan,UIN,Tahu bulat,Tahu bulat Pesanggrahan', 'tahu-bulat', '500', '<p>Kalian semua pasti mengenal atau sangat familiar dengan makanan yang satu ini. Ya betul sekali tahu bulat, mungkin saat ini kamu bisa dengan mudah menemukan tahu bulat, karena camilan populer ini mulai dijajakan keliling ke kampung hingga di tengah kota besar menggunakan mobil, dengan iringan musik khas yang pastinya menarik perhatian. Tapi kali ini, kamu bisa dengan mudah menemukan cemilan yg mantap satu ini di jalan pesanggrahan UIN. ohya, cemilan hits ini pun memiliki rasa nya yang cukup gurih dan sedikit asin, sangat cocok sekali jika dimakan dengan ditemani Kopi ABC susu.</p>', 'Tahu berbentuk bulat yang hits di Pesanggrahan UIN', 0.00, 13, 'publish', 'M. Noviar Widodo', 1, '2018-04-01 08:17:27', '2018-04-05 21:31:55', '2018-04-05 21:31:55'),
(9, 91, 9, 'Sempol Ayam Pertigaan Reni', 'Sempol Ayam Pertigaan Reni', 'Jam Buka : 18.00 - 23.00', 'Sempol ayam,sempol ayam pamulang', 'sempol-ayam-pertigaan-reni', '2000', '<p>Cemilan yang satu ini mungkin masih awam banget ya untuk sebagian orang.&nbsp; Cemilan sempol ayam ini terbuat dari adonan ayam yang di balut dengan telur gulung lalu di goreng. Rasanya enak dan sedikit kenyal, lumayan mengenyangkan , karna isiannya padat walaupun terlihat kecil. Cocok banget buat cemilan sore hari.</p>\r\n<p>Depan Madrasah Ibtidaiyah Assa\'adatuddarain</p>\r\n<p>Jam Buka : 18.00 - 23.00</p>', 'Depan Madrasah Ibtidaiyah Assa\'adatuddarain', 0.00, 14, 'publish', 'Julius Subang', 1, '2018-04-01 11:33:59', '2018-04-05 21:32:01', '2018-04-05 21:32:01'),
(10, 61, 11, 'Telor Gulung Bihun Pertigaan Reni', 'Telor Gulung Bihun Pertigaan Reni', NULL, 'Telor Gulung ,Telor Gulung BIhun,Telor Gulung Bihun Pamulang', 'telor-gulung-bihun-pertigaan-reni', '1000', '<p>Jajanan cemilan telor gulung yang udah ada dari zaman dulu ini masih ada yang jual loh. tetapi telur gulung ini ada isian bihunnya. Rasanya enak, dijual dengan harga yang murah pas banget dikantong pelajar. Ditambah saus sambalnya yang pedas bikin rasanya makin nikmat dan lezat. Cocok banget buat cemilan sore hari.</p>\r\n<p>Depan <a href=\"https://www.google.co.id/search?q=madrasah+ibtidaiyah+assa\'adatuddarain&spell=1&sa=X&ved=0ahUKEwiWjqmvr97ZAhVMwLwKHQLKDFYQBQgkKAA\">Madrasah Ibtidaiyah Assa\'adatuddarain</a></p>\r\n<p>Buka      : 18.00 - 23.00</p>', 'Telor Gulung Pertigaan Reni', 0.00, 14, 'publish', 'Julius Subang', 1, '2018-04-01 11:41:46', '2018-04-05 21:32:10', '2018-04-05 21:32:10'),
(11, 92, 12, 'Sempol Sosis Pertigaan Reni', 'Sempol Sosis Pertigaan Reni', 'Sempol Sosis Pertigaan Reni', 'sempol sosis,sempol sosis pamulang', 'sempol-sosis-pertigaan-reni', '2000', '<p>Cemilan yang satu ini mungkin masih awam banget ya untuk sebagian orang. Cemilan sempol sosis ini terbuat dari sosis sapi dan ada juga yang sosis ayam dan di balut dengan telur lalu di gulung saat di goreng. Rasanya enak, apalagi ditambah saus sambal pedasnya. Cocok banget buat cemilan sore hari bareng keluarga.</p>\r\n<p>&nbsp;</p>\r\n<p>Depan <a href=\"https://www.google.co.id/search?q=madrasah+ibtidaiyah+assa\'adatuddarain&amp;spell=1&amp;sa=X&amp;ved=0ahUKEwiWjqmvr97ZAhVMwLwKHQLKDFYQBQgkKAA\">Madrasah Ibtidaiyah&nbsp;Assa\'adatuddarain</a></p>\r\n<p>Buka &nbsp;&nbsp;&nbsp;&nbsp; : 18.00-23.00</p>', 'Sempol Sosis Pertigaan Reni', 0.00, 14, 'publish', 'Julius Subang', 1, '2018-04-01 11:58:45', '2018-04-05 21:32:15', '2018-04-05 21:32:15'),
(12, 93, 13, 'Bakso Goreng Pertigaan Reni', 'Bakso Goreng Pertigaan Reni', 'Bakso Goreng Pertigaan Reni', 'Bakso Goreng ,Basreng,basreng pamulang', 'bakso-goreng-pertigaan-reni', '2500', '<p>Bakso goreng ini lebih dikenal dengan nama Basreng (Bakso Goreng). Bakso goreng ini ukurannya lumayan besar, bentuknya di buat seperti bunga dan ini salah satu daya tarik Bakso Goreng ini. Bakso goreng ini renyah banget rasanya dan disediakan juga saus untuk cocolnya , bisa di cocol maupun di campur menjadi satu.</p>\r\n<p>Depan <a href=\"https://www.google.co.id/search?q=madrasah+ibtidaiyah+assa\'adatuddarain&spell=1&sa=X&ved=0ahUKEwiWjqmvr97ZAhVMwLwKHQLKDFYQBQgkKAA\">Madrasah Ibtidaiyah Assa\'adatuddarain</a></p>\r\n<p>Buka      : 18.00 – 23.00</p>', 'Bakso Goreng Pertigaan Reni', 0.00, 14, 'publish', 'Julius Subang', 1, '2018-04-01 12:20:35', '2018-04-05 21:32:21', '2018-04-05 21:32:21'),
(13, 94, 14, 'Martabak Telor Mini  Pertigaan Reni', 'Martabak Telor Mini  Pertigaan Reni', 'Martabak Telor Mini  Pertigaan Reni', 'Martabak,Martabak Telor,Martabak Telor Mini', 'martabak-telor-mini-pertigaan-reni', '5000', '<p>Kalau biasanya martabak telor itu punya ukuran yang besar, martabak telor yang satu ini punya ukuran yang lebih kecil dari martabak pada umumnya. Martabak ini terbuat dari kulit lumpia yang diisi dengan telur, irisan kol dan irisan daun bawang. Rasanya gurih dan enak banget gak kalah deh sama martabak telor biasanya.&nbsp;&nbsp; &nbsp;</p>\r\n<p>Depan <a href=\"https://www.google.co.id/search?q=madrasah+ibtidaiyah+assa\'adatuddarain&amp;spell=1&amp;sa=X&amp;ved=0ahUKEwiWjqmvr97ZAhVMwLwKHQLKDFYQBQgkKAA\">Madrasah Ibtidaiyah&nbsp;Assa\'adatuddarain</a></p>\r\n<p>Buka&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : 18.00 &ndash; 23.00</p>', 'Martabak Telor Mini  Pertigaan Reni', 0.00, 13, 'publish', 'Julius Subang', 1, '2018-04-01 12:30:50', '2018-04-05 21:32:26', '2018-04-05 21:32:26'),
(14, 63, 15, 'Pancong Simpang Pejompongan', 'Kue Pancong Simpang Pejompongan', 'Pancong Betawi Simpang Pejompongan', 'pancong,betawi,kue pancong,pancong pejompongan,pancong simpang pejopongan', 'pancong-simpang-pejompongan', '9000', '<p>Salah satu jajanan tradisional Indonesia yang saat ini mulai menghilang adalah Kue Pancong. Menurut catatan sejarah, jajanan kue basah ini berasal dari Jakarta, tak ayal banyak orang menyebut Kue Pancong sebagai ikon Betawi. Kini kamu bisa dengan mudah mendapatkan kue pancong yang memiliki citarasa betawi banget ini di simpang pejompongan, dan jangan lupa sedikit tips, pancong sangat nikmat dimakan bersama Kopi ABC susu.</p>\r\n<p>Jam buka : 24 jam</p>', 'Kue tradisional dengan citarasa yang Betawi banget', 0.00, 13, 'publish', 'M. Noviar Widodo', 1, '2018-04-02 00:24:44', '2018-04-05 21:32:31', '2018-04-05 21:32:31'),
(15, 98, 16, 'Bikang Mawar Pasar Modern Paramount', 'Bikang Mawar Pasar Modern Paramount', 'Bikang Mawar Pasar Modern Paramount', 'bikang,kue bikang,pasar modern,pasar modern paramount,serpong', 'bikang-mawar-pasar-modern-paramount', '1.500', '<p style=\"text-align: center;\"><strong>Bikang Mawar</strong></p>\r\n<p>Kue yang satu ini cukup menarik dilihat serta cita rasanya lezat yakni kue bikang. Kue bikang yang dijual di pasaran biasanya memiliki bentuk seperti bunga mawar yang merekah dan mekar dengan warna yang sangat cantik sehingga  menarik dipandang mata. Kue yang cantik satu ini terbuat dari tepung beras, tepung kanji dan tepung terigu yang di campur dengan santan dan telur lalu di kukus hingga mekar. Bikang adalah salah satu camilan tradisional yang biasanya dijual bersama dengan kue pukis dan kue basah lain nya. Kita bsa menemukan kue bikang di penjual jajanan pasar dengan harga yang sangat terjangkau.</p>\r\n<p style=\"text-align: center;\">Alamat : Pasar Modern Paramount</p>\r\n<p style=\"text-align: center;\">Jam Buka : 06.00 – 11.00</p>', 'Bikang adalah salah satu camilan tradisional yang biasanya dijual bersama dengan kue pukis dan kue basah lainnya.', 0.00, 15, 'publish', 'Resty Kumala', 1, '2018-04-02 15:58:39', '2018-04-05 21:32:36', '2018-04-05 21:32:36'),
(16, 99, 18, 'Cilok Kuah CLBK', 'Cilok Kuah CLBK', 'Jam 12.00 - 00.00', 'Cilok Kuah,Cilok ,Cilok Kuah Cinangka', 'cilok-kuah-clbk', '5000', '<p>Cemilan yang terbuat dari tepung aci atau tapioka ini khas daerah Jawa Barat. Siapa si yang ga tau sama cilok , tapi kali ini ciloknya berbeda kalo cilok pada umumnya disiram dengan bumbu kacang ,saus dan kecap, kalau cilok satu ini dengan kuah kaldu hampir mirip dengan kuah bakso. Cilok kuah ini dilengkapi dengan tahu kulit atau tahu coklat yang dalamnya diisi dengan adonan ciloknya , untuk menambah cita rasa dari tahunya. Tektur ciloknya pas banget gak keras dan ga terlalu kenyal. Mantap deh</p>\r\n<p>Depan Alfamart</p>\r\n<p>Jam 12.00 - 00.00</p>', 'Cilok Kuah CLBK', 0.00, 14, 'publish', 'Julius Subang', 1, '2018-04-02 18:22:17', '2018-04-05 21:32:43', '2018-04-05 21:32:43'),
(17, 100, 19, 'Siomay Bandung Pertigaan Reni', 'Siomay Bandung Pertigaan Reni', 'jam 18.00 - 23.00', 'Siomay, siomay bandung', 'siomay-bandung-pertigaan-reni', '10000', '<p>Siapa sih yang ga tau sama cemilan satu ini. Siomay khas Bandung ini terbuat dari ikan tengiri, biasanya siomay disajikan dengan berbagai jenis pelengkap seperti telur, tahu, kol, dan pare tergantung permintaan dari pembeli itu sendiri ditambah bumbu siomay yang lezat disiram diatas siomaynya sehingga rasanya lebih nikmat. Siomay ini cocok banget buat cemilan nonton Tv atau saat nongkrong.</p>\r\n<p>Depan <a href=\"https://www.google.co.id/search?q=madrasah+ibtidaiyah+assa\'adatuddarain&spell=1&sa=X&ved=0ahUKEwiWjqmvr97ZAhVMwLwKHQLKDFYQBQgkKAA\">Madrasah Ibtidaiyah Assa\'adatuddarain</a></p>\r\n<p>Jam Buka : 18.00 - 23.00</p>', 'Siomay Bandung Pertigaan Reni', 0.00, 14, 'publish', 'Julius Subang', 1, '2018-04-02 18:33:54', '2018-04-05 21:32:49', '2018-04-05 21:32:49'),
(18, 101, 20, 'Bolu Kukus Mekar Pasar Modern Paramount Serpong', 'Bolu Kukus Mekar Pasar Modern Paramount Serpong', 'Bolu Kukus Mekar Pasar Modern Paramount Serpong', 'Bolu Kukus Mekar Pasar Modern Paramount Serpong,Bolu Kukus,Bolu Kukus Mekar, Pasar Modern,Pasar Modern Paramount,Serpong', 'bolu-kukus-mekar-pasar-modern-paramount-serpong', '1500', '<p style=\"text-align: center;\"><strong>Bolu Kukus Mekar</strong></p>\r\n<p>Warna nya cantik bukan ? Camilan satu ini adalah Bolu Kukus, dari penampilan nya sangat menarik dengan berbagai warna yang cantik. Bentuk nya mirip dengan <em>cup cake</em>, tapi jangan khawatir, rasanya tak kalah enak dari <em>cup cake</em> yg biasa kita jumpai di mall. Bolu Kukus terbuat dari adonan tepung  terigu, telur, susu, vanili dan bahan lain nya yang di tuangkan pada sebuah cetakan dan dikukus hingga mengembang. Rasanya manis dan tekstur yang sangat lembut membuat bolu kukus ini sangat di minati masyarakat terutama oleh anak-anak. Kita bisa menemukan bolu kukus seperti ini di penjual jajanan pasar dengan harga yang sangat terjangkau.</p>\r\n<p> </p>\r\n<p style=\"text-align: center;\">Alamat : Pasar Modern Paramount</p>\r\n<p style=\"text-align: center;\">Jam Buka : 06.00 – 11.00</p>', 'Warna nya cantik bukan ? Camilan satu ini adalah Bolu Kukus, dari penampilan nya sangat menarik dengan berbagai warna yang cantik. Bentuk nya mirip dengan cup cake, tapi jangan khawatir, rasanya tak kalah enak dari cup cake yg biasa kita jumpai di mall.', 0.00, 15, 'publish', 'Resty Kumala', 1, '2018-04-03 11:01:45', '2018-04-05 21:32:55', '2018-04-05 21:32:55'),
(19, 102, 21, 'Kue Bugis Toko Kue Hany', 'Kue Bugis Toko Kue Hany', 'Kue Bugis Toko Kue Hany', 'Kue Bugis Toko Kue Hany,kue bugis,kue basah,tradisional,jajanan,jajanan tradisional,jajanan pasar,kuehany', 'kue-bugis-toko-kue-hany', '2.000', '<p style=\"text-align: center;\"><strong>KUE BUGIS</strong></p>\r\n<p><strong> </strong></p>\r\n<p>Kalau makanan yang terbuat dari tepung ketan ini namanya kue bugis. Walaupun namanya kue bugis, tapi kue ini asalnya bukan dari Bugis, lho. Biasanya kue ini juga kerap disajikan saat acara kumpul keluarga atau arisan. Teksturnya yang sedikit liat dengan semburat rasa manis dan gurih dari isian kelapanya membuat kue ini semakin enak. Apalagi kalau ditemani secangkir kopi atau teh hangat. Yummy!</p>\r\n<p> </p>\r\n<p> </p>\r\n<p style=\"text-align: center;\">Alamat            : Toko Kue Hany - Jl. Masjid Gedong No.6, Kel. Gedong, Jakarta Timur</p>\r\n<p style=\"text-align: center;\">Jam Buka        : 06.00-12.00</p>', 'Kalau makanan yang terbuat dari tepung ketan ini namanya kue bugis. Walaupun namanya kue bugis, tapi kue ini asalnya bukan dari Bugis, lho. Biasanya kue ini juga kerap disajikan saat acara kumpul keluarga atau arisan.', 0.00, 15, 'publish', 'Febriyanti Wulan Dari', 1, '2018-04-03 11:23:27', '2018-04-03 11:23:27', NULL),
(20, 64, 17, 'Onde-onde Simpang Rempoa', 'Onde-onde simpang Rempoa', 'Onde-onde Simpang Rempoa', 'Onde-onde,onde-onde,enak,simpang rempoa,ciputat,onde-onde enak,onde-onde mantap', 'onde-onde-simpang-rempoa', '500', '<p>Onde-onde merupakan salah satu jajanan pasar paling populer di Indonesia. Ternyata, onde-onde berasal dari China. Makanan ini dibawa oleh pedagang China yang berdagang ke Indonesia, dan kemudian dimodifikasi sesuai dengan kreasi nusantara. Naah kali ini kamu ga akan kesulitan mencari cemilan yg enak dan memberikan kejutan di bagian dalamnya ini, jika kamu berada di sekiaran rempoa kamu bisa langsung datang ke alamat yang sudah tertera. Dan jangan lupa cemilan yang satu ini sangat pas disantap dengan segelas panas Kopi ABC susu.</p>', 'Onde-onde enak dan mantap yang bertempat di simpang rempoa.', 0.00, 13, 'publish', 'M. Noviar Widodo', 1, '2018-04-03 13:10:47', '2018-04-05 21:33:19', '2018-04-05 21:33:19'),
(21, 104, 22, 'Kue Cucur Pasar Bengkok', 'Kue Cucur Pasar Bengkok', 'Kue Cucur Pasar Bengkok', 'kue,cucur,kue cucur,pasar,pasar bengkok', 'kue-cucur-pasar-bengkok', '1.000', '<p>Kue cucur, jajanan berbentuk bulat dan berwarna kecoklatan ini merupakan jajanan yang cukup dikenal sebagai jajanan untuk upacara-upacara adat di berbagai daerah di Indonesia.</p>\r\n<p>&nbsp;</p>\r\n<p>Seperti yang ada di beberapa daerah di pulau Jawa, kue cucur dijadikan sebagai salah satu hantaran pengikat tali kasih (peningset pelengkap) yang dibawa oleh mempelai pria untuk sang mempelai wanita. Di Jogjakarta, kue cucur juga dijadikan sebagai hidangan bagi tamu yang berkunjung ke rumah, selain sebagai sesajen saat acara slametan.</p>\r\n<p>&nbsp;</p>\r\n<p>Di Sumatra Barat, setelah acara akad nikah, pihak perempuan wajib melakukan acara berkunjung ke rumah mertua atau disebut dengan upacara manjalang mintuo, batandang, mahanta nasi, manyaok kandang atau mahanta nasi katunduakan, mahanta bubue. Pada upacara ini, pihak keluarga wanita wajib membawa kue yang berbentuk bulat seperti pinyaram (cucur). Ada pula tradisi maanta juadah, yaitu pihak wanita mengantarkan juadah kepada pihak pria. Adapun juadah terdiri dari enam macam kue yang salah satunya ialah pinyaram (cucur).</p>\r\n<p>&nbsp;</p>\r\n<p>Di Sulawesi Utara ada cerita yang beredar di masyarakat bahwa seorang gadis yang tidak dapat membuat kue cucur dengan baik, maka dia tidak diperkenankan untuk menikah. Di Gorontalo, kue cucur disajikan saat panen padi. Para petani menikmati kue cucur bersama-sama, bahkan terjadi barter antara kue cucur yang ditukar dengan beberapa ikat padi.</p>\r\n<p>Jadi, selain rasanya yang manis, kue cucur juga berperan dalam upacara-upacara adat di berbagai penjuru nusantara.</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\">Alamat : Gerobak Cucur Pasar Bengkok &ndash; Pertigaan Jl. Hasyim Asyari &amp; Mas Mansyur, Pinang.</p>\r\n<p style=\"text-align: center;\">Jam Buka : 15.00 &ndash; 20.00</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>', 'Kue cucur, jajanan berbentuk bulat dan berwarna kecoklatan ini merupakan jajanan yang cukup dikenal sebagai jajanan untuk upacara-upacara adat di berbagai daerah di Indonesia.', 0.00, 15, 'publish', 'Annizar Mohammad Farhani', 1, '2018-04-03 14:04:35', '2018-04-05 21:33:24', '2018-04-05 21:33:24'),
(22, 108, 23, 'Carang Mas Pasar Pagi Tugu Pahlawan', 'Carang Mas Tugu Pahlawan', 'Carang Mas Tugu Pahlawan', 'kue,jajanan,tradisional,carang mas,tugu pahlawan,surabaya', 'carang-mas-pasar-pagi-tugu-pahlawan', '2.0000', '<p style=\"text-align: center;\"><strong>Carang Mas</strong></p>\r\n<p>Kue carang mas atau walangan merupakan jajanan atau camilan tradisional yang sudah ada dari dulu, dan hingga kini masih banyak yang menyukai jajanan ini. Carang mas merupakan camilan khas Indonesia yang terbuat dari ubi kayu atau ketela rambat. Di beberapa daerah kue carang mas memiliki nama lain seperti grubi, walangan, kue kremes, sarang balam atau cakar ayam. Carang mas memiliki rasa manis yang berasal dari gula jawa yang juga berperan sebagai perekat serpihan satu sama lain. Tekstur nya renyah, krispi dan sedikit lengket. Kita bisa menemukan Carang mas di toko oleh-oleh atau di penjual jajanan pasar.</p>\r\n<p> </p>\r\n<p style=\"text-align: center;\">Alamat : Pasar Pagi Tugu Pahlawan, Surabaya</p>\r\n<p style=\"text-align: center;\">Jam Buka : Sabtu - Minggu 07.00 – 13.00</p>\r\n<p style=\"text-align: center;\"> </p>', 'Kue carang mas atau walangan merupakan jajanan atau camilan tradisional yang sudah ada dari dulu, dan hingga kini masih banyak yang menyukai jajanan ini.', 0.00, 15, 'publish', 'Resty Kumala', 1, '2018-04-03 14:21:49', '2018-04-03 14:21:49', NULL),
(23, 110, 24, 'Cilung depan SMPN 11 Tangerang', 'Cilung Depan SMPN 11 Tangerang', 'Cilung Depan SMPN 11 Tangerang', 'cilung,aci digulung,aci gulung,tangerang', 'cilung-depan-smpn-11-tangerang', '1000', '<p style=\"text-align: center;\"><strong>Cilung</strong></p>\r\n<p>Adakah yang tak kenal dengan camilan satu ini? Cilung adalah sebutan dari aci digulung. Aci dalam bahasa sunda adalah  tepung kanji atau sagu. Cilung merupakan sebuah nama jajanan khas indonesia yang banyak digemari masyarakat terutama anak-anak. Cilung dibuat dari bahan dasar aci seperti makanan pada umumnya yakni cimol, cireng, cilok dan lain sebagainya. Cilung banyak dijual di perkampungan dan di depan sekolah dasar yang pembelinya yang tak lain mulai dari kalangan anak-anak hingga kalangan orang tua. Rasanya gurih dan teksturnya kenyal karena terbuat dari tepung kanji. Setelah di goreng, cilung biasanya di lumuri dengan bumbu bubuk sebagai penyedap.</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">Alamat : Depan SMPN 11 Tangerang</p>\r\n<p style=\"text-align: center;\">Jam Buka : 09.00 – 14.00</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p> </p>', 'Cilung adalah sebutan dari aci digulung', 0.00, 15, 'publish', 'Resty Kumala', 1, '2018-04-03 14:38:48', '2018-04-03 14:38:48', NULL),
(24, 109, 25, 'Cilor Pedas Makaroni Ngoceh', 'Cilor Pedas Makaroni Ngoceh', 'Cilor Pedas Makaroni Ngoceh', 'Cilor,Cilor pedas', 'cilor-pedas-makaroni-ngoceh', '5000', '<p>Cilor ini memiliki artian cilok telor, ternyata isiannya bukan hanya cilok aja tapi ada makaroni basahnya, membuat rasa cilornya semakin nikmat. Nah cara pembuatannya, cilok yang telah dipotong kecil-kecil, makaroni basah, telur dan garam diaduk menjadi 1, setelah itu di masak dalam loyang bulan kecil-kecil setelah matang diletakan pada mangkuk besar dan di beri bumbu pedas/baberque/asin sesuai selera kalian. Lalu di kocok hingga tercampur rata. Rasanya yummy banget cocok deh buat cemilan.</p>\r\n<p>Sebelah Griya Sasmita </p>\r\n<p>Jam : 16.00/Habis</p>', 'Cilor Pedas Makaroni Ngoceh', 0.00, 14, 'publish', 'Julius Subang', 1, '2018-04-03 14:47:30', '2018-04-05 21:33:34', '2018-04-05 21:33:34'),
(25, 111, 25, 'Otak Otak Pedas Makaroni Ngoceh', 'Otak Otak Pedas Makaroni Ngoceh', 'Otak Otak Pedas Makaroni Ngoceh', 'Otak otak,otak otak pedas', 'otak-otak-pedas-makaroni-ngoceh', '5000', '<p>Cemilan kali ini bukan sekedar otak-otak biasa, otak-otak ini cocok banget buat penyuka pedas, karna bisa sampe level pedes banget, buat yang ga suka pedes tenang aja disini juga tersedia bumbu baberque dan asin. Otak-otak ini dipotong kecil” lalu di goreng setelah matang otak-otaknya di letakan ke dalam wadah dan diisi bumbu sesuai keinginan kalian dan di kocok-kocok hingga bumbu menjadi satu dengan otak”. Enak banget deh buat cemilan nonton film.</p>\r\n<p>Samping Griya Sasmita Serua</p>\r\n<p>Jam Buka : 16.00 - Habis</p>', 'Otak Otak Pedas Makaroni Ngoceh', 0.00, 14, 'publish', 'Julius Subang', 1, '2018-04-03 15:03:50', '2018-04-05 21:33:40', '2018-04-05 21:33:40'),
(26, 112, 27, 'Pukis Coklat Indo Mas', 'Pukis Coklat Indo Mas', 'Pukis Coklat Indo Mas', 'pukis,pukis coklat,pukis depok', 'pukis-coklat-indo-mas', '2000', '<p>Kue basah ini sering banget kita temuin saat ada acara arisan,atau acara keluarga. Cemilan ini memiliki banyak rasa salah satunya yang coklat. Kuenya yang lembut dan rasanya yang enak bikin orang yang memakannya ketagihan loh. Dan yang paling penting cemilan ini cocok banget di minum dengan secangkir kopi ABC Susu. Perpaduan yang cocok bukan.</p>\r\n<p>Jam Buka : 16.00 - Habis</p>', 'Pukis Coklat Indo Mas', 0.00, 14, 'publish', 'Julius Subang', 1, '2018-04-03 15:19:27', '2018-04-05 21:33:46', '2018-04-05 21:33:46'),
(27, 113, 27, 'Risol Indo Mas', 'Risol Indo Mas', 'Risol Indo Mas', 'Risol ,Risol depok', 'risol-indo-mas', '2000', '<p>Siapa sih yang ga tau risol? Risol bisa jadi salah satu cemilan yang bisa mengganjal lapar atau cemilan saat pagi hari. Risol ini banyak banget macam isiannya. Salah satunya risol ini yang memilki isian kentang,wortel dan buncis yang telah dipotong kecil-kecil. Ukurannya lumayan besar dan risol ini sangat lembut loh ketika digigit.</p>\r\n<p> </p>\r\n<p>Jam Buka : 16.00 - Habis</p>', 'Risol adalah adalah pastri berisi daging, biasanya daging cincang, dan sayuran yang dibungkus dadar, dan digoreng setelah dilapisi tepung panir dan kocokan telur ayam.', 0.00, 14, 'publish', 'Julius Subang', 1, '2018-04-03 15:43:50', '2018-04-05 21:33:52', '2018-04-05 21:33:52'),
(28, 114, 28, 'Tahu Pedas Reni Jaya', 'Tahu Pedas Reni Jaya', 'Tahu Pedas Reni Jaya', 'Tahu Pedas,Tahu Pedas Pamulang', 'tahu-pedas-reni-jaya', '2000', '<p>Siapa yang suka makan pedes ? Harus cobain tahu pedes satu ini guys. Tahu pedes ini diisi dengan sayur-sayuran yang telah di campur bumbu pedas lalu tahunya dilumuri adonan terigu dan digoreng hingga matang dan kering. Ukuran tahu pedas ini sendiri lumayan besar loh. Rasanya bener-bener enak untuk penyuka pedas .</p>\r\n<p> </p>\r\n<p>Jam Buka : 16.00 - 22.00</p>', 'Tahu Pedas Reni Jaya', 0.00, 14, 'publish', 'Julius Subang', 1, '2018-04-03 15:58:32', '2018-04-05 21:34:00', '2018-04-05 21:34:00'),
(29, 116, 29, 'Pancong Rawabelong', 'Pancong Rawabelong', 'Pancong Rawabelong', 'Pancong,pancong rawabelong', 'pancong-rawabelong', '15000', '<p>Pancong adalah makanan yang khas dari Kota Jakarta. Pancong terbuat dari tepung beras dan santan atau kelapa. Panganan ini jika disajikan secara original rasanya sangat gurih. Dibentuk di atas cetakan. Biasanya pada bagian atasnya ditaburi dengan gula pasir. Tetapi pancong khas rawa belong memiliki ciri varian yang bermacam-macam. Pembuatannya sesuai dengan keinginan pembeli. Bisa matang atau setengah matang. Untuk toppingnya sendiri pun dibuat dengan berbagai varian rasa, ditambah susu kental manis, keju, maupun cokelat. Rasanya sungguh nikmat. Biasanya dimakan saat malam hari bersama teman-teman sebagai teman nongkrong. Hal ini akan menjadi perpaduan yang pas jika disajikan dengan kopi susu ABC .</p>\r\n<p> </p>\r\n<p>Jam Buka : 24 jam</p>', 'Pancong Rawabelong', 0.00, 14, 'publish', 'Sifqa Amalia Ramadhanti', 1, '2018-04-03 17:02:59', '2018-04-05 21:34:08', '2018-04-05 21:34:08'),
(30, 117, 30, 'Arum Manis Mama Indah', 'Arum Manis Mama Indah', 'Arum Manis Mama Indah', 'Arum Manis,Arum Manis tangsel,rambut nenek', 'arum-manis-mama-indah', '3000', '<p style=\"text-align: justify;\">Back to zaman SD banget pasti kalian pernah dong makan jajanan yang berwarna warni berbahan dasar gula? Iyaps betul, arum manis namanya. Bentuknya lembut, panjang, layaknya orang menyebutnya dengan istilah lain yaitu rambut nenek. Camilan ini juga cocok untuk segala usia. Seakan ada magnet kebahagiaan bagi siapapun yang memakannya. Memiliki berbagai macam warna yang membuatnya semakin menarik. Biasanya cemilan ini terdapat dua kerupuk yang rasanya lebih gurih dan asin untuk menutupi bagian atas dan bawah. Lalu ditengahnya barulah diisi dengan si gula yang manis itu. Sebuah perpaduan rasa yang cocok abis jika kita sandingkan dengan segelas kopi mantap ABC susu.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p>Jam Buka : 09.00-17.00 WIB</p>', 'Arum Manis Toko Mama Indah', 3.00, 14, 'publish', 'Sifqa Amalia Ramadhanti', 1, '2018-04-03 17:19:05', '2018-04-05 21:34:19', '2018-04-05 21:34:19'),
(31, 118, 30, 'Bika Ambon Mama Indah', 'Bika Ambon Mama Indah', 'Bika Ambon Mama Indah', 'Bika Ambon,Bika Ambon Tangsel', 'bika-ambon-mama-indah', '5000', '<p style=\"text-align: justify;\">Bika Ambon merupakan kue khas yang berasal dari Medan. Walaupun begitu, penyebarannya sudah terkenal se-Nusantara. Bika Ambon merupakan kue berwarna kuning dengan tekstur yang legit dan berlubang-lubang di atasnya. Bahan utama dalam membuat cemilan ini adalah tepung sagu, kelapa, ragi, garam dan gula. Pada dasar nya, membuat Resep Bika Ambon Medan Panggang atau Kukus sama saja, cuma mungkin di tahap akhirnya yang sedikit berbeda. Satu perlu oven untuk memanggang dan satu lagi perlu di kukus dengan air mendidih dengan api sedang. Memakan bika ambon seakan ada rasa nagih terus menerus. Sebuah kenikmatan jika ditemani dengan secangkir kopi ABC susu.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p>Jam buka : 09.00-17.00 WIB</p>', 'Bika ambon adalah sejenis penganan asal Indonesia. Terbuat dari bahan-bahan seperti telur, gula, dan santan, bika ambon umumnya dijual dengan rasa pandan', 0.00, 14, 'publish', 'Sifqa Amalia Ramadhanti', 1, '2018-04-03 17:28:21', '2018-04-05 21:34:57', '2018-04-05 21:34:57'),
(32, 103, 20, 'Dim Sum', 'Dimsum Pastellia BSD', 'Dimsum enak Pastellia pasar modern BSD', 'Dim Sum,dim sum,dimsum,Dimsum,Pastellia,pastellia,BSD', 'dim-sum', '10.000', '<p>Dim Sum adalah salah satu makanan yang cukup jadi favorit banyak kalangan, karena dim sum sendiri bukan kaegori makanan berat namun tidak terlalu ringan juga untuk di santap, memiliki berbagai macam varian yang ada dari mulai bakpao, hakau, dumpling, gyoza, dan siomai, sehingga membuat kita sendiri tidak bosan menikmatinya. dim sum sendiri sudah sangat lama di perkenalkan oleh bangsa tiongkok di indonesia, dan sudah beratus tahun umurnya di indonesia, maka dim sum sudah sangat melekat bagi seluruh masyarakat indonesia, dan biasanya di santap bersama dengan teh atau kopi. hmm.. dengan Kopi ABC susu, dim sum ini semakin mantap dan nikmat!</p>\r\n<p> </p>', 'Dim Sum adalah salah satu makanan yang cukup jadi favorit banyak kalangan memiliki berbagai macam varian yang ada dari mulai bakpao, hakau, dumpling, gyoza, dan siomai, sehingga membuat kita sendiri tidak bosan menikmatinya.', 0.00, 13, 'draft', 'Mia', 1, '2018-04-03 17:38:49', '2018-04-05 21:35:03', '2018-04-05 21:35:03'),
(33, 119, 30, 'Dadar Gulung Mama Indah', 'Dadar Gulung Mama Indah', 'Dadar Gulung Mama Indah', 'Dadar Gulung', 'dadar-gulung-mama-indah', '2500', '<p>Dadar gulung adalah salah satu resep kue basah tradisional yang terbuat dari bahan sederhana seperti tepung terigu, parutan kelapa, gula jawa, pandan.  Resep dadar gulung biasanya menggunakan pandan sebagai pewarna luarnya. Cara pembuatannya yaitu dua langkah dengan membuat kulit dadar gulung nya serta membuat isinya yang bisa disesuaikan dengan selera kita. Umumnya isian dari dadar gulung adalah parutan kelapa yang telah dicampur dengan gula aren. Saat digigit, kelembutan dari kulit pandan dan rasa manisnya sangat terasa. Terlebih lagi jika kita menikmatinya dengan secangkir kopi ABC susu.</p>\r\n<p> </p>\r\n<p>Jam Buka : 09.00-17.00 WIB</p>', 'dadar gulung  merupakan penganan khas Indonesia dan Malaysia yang dapat digolongkan sebagai pancake yang diisi dengan parutan kelapa yang dicampur dengan gula jawa cair. Isi ini disebut unti.', 0.00, 14, 'publish', 'Sifqa Amalia Ramadhanti', 1, '2018-04-03 17:40:09', '2018-04-05 21:35:11', '2018-04-05 21:35:11'),
(34, 105, 26, 'Apem Panggang', 'Apem Panggang', 'Apem panggang makanan tradisional', 'Apem,Panggang,apem panggang,Apem panggang', 'apem-panggang', '7500', '<p><br data-mce-bogus=\"1\"></p>', 'Apem panggang adalah salah satu cemilan yang nusantara banget', 0.00, 13, 'publish', 'Mia', 1, '2018-04-03 21:12:10', '2018-04-05 21:35:18', '2018-04-05 21:35:18'),
(35, 106, 26, 'Gethuk', 'Gethuk khas Jawa Tengah', 'Gethuk lindri', 'Gethuk,Gethuk lindri,Gethuk enak,Gethuk mantap', 'gethuk', '4500', '<p>Gethuk adalah salah satu cemilan yang sangat khas dari jawa tengah, yang terbuat dari olahan singkong dengan di taburi kelapa parut yang gurih, menambah cita rasa khas, dan juga cukup menggugah selera dengan warna-warni yang cukup menarik, biasanya didaerah asal gethuk ini digunakan sebagai cemilan <em>teman ngopi, </em>yang artinya biasanya makanan ini cocok dinikmati di pagi atau sore hari ketika waktu istirahat setelahh beraktifitas. hmmm.. kalau teman ngopi, berarti cemilan ini sudah dipastikan cocok dan makin mantap nih disantap bersama kopi ABC Susu.</p>', 'Gethuk adalah salah satu cemilan yang sangat khas dari jawa tengah, yang terbuat dari olahan singkong dengan di taburi kelapa parut yang gurih, menambah cita rasa khas, dan juga cukup menggugah selera dengan warna-warni yang cukup menarik', 0.00, 1, 'publish', 'Mia', 1, '2018-04-03 21:19:26', '2018-04-05 21:35:29', '2018-04-05 21:35:29'),
(36, 121, 32, 'Tahu Krispi 49', 'Tahu Krispi 49', 'Tahu Krispi 49', 'tahu,krispi,tahu krispi,tahu krispi 49', 'tahu-krispi-49', '1000', '<p>Butuh camilan dan konsentrasi di sore hari cocok untuk menikmati Tahu Krispi sambil seduh Kopi ABC Susu. Kopi ABC Susu pasti membuat aktifitas lebih fokus dan tahu krispi bisa menambah konsentrasi dan perut terisi. Disajikan dengan tambahan bumbu dari berbagai jenis varian rasa akan buat sensasi seru di lidah. Dengan rasa tahu yang gurih sambil seruput hangatnya Kopi ABC Susu, hmm sedap! Soremu akan jadi semakin seru dengan Kopi ABC Susu.</p>\r\n<p> </p>\r\n<p style=\"text-align: center;\">Alamat : Jl. H. Ali Tegal Parang Selatan 1</p>\r\n<p style=\"text-align: center;\">Jam Buka : 16.00 – 21.00</p>', 'Disajikan dengan tambahan bumbu dari berbagai jenis varian rasa akan buat sensasi seru di lidah.', 0.00, 15, 'publish', 'Sarah Dyah Ayu', 1, '2018-04-04 13:50:51', '2018-04-05 21:35:44', '2018-04-05 21:35:44'),
(37, 122, 32, 'Cilok Goreng 49', 'Cilok Goreng 49', 'Cilok Goreng 49', 'cilok,goreng,tahu krispi 49,CILOK GORENG 49', 'cilok-goreng-49', '5000', '<p>Cilok memiliki arti dari gabungan kata Aci yang dicolok, dan cilok yang satu ini cilok yang digoreng. Cilok goreng ini sangat cocok dengan Kopi ABC Susu menjadi perpaduan yang pas. Bisa disantap kapan saja apalagi untuk momen nyemil bareng keluarga. Anda bisa menikmati cilok goreng ini yang disajikan dengan rasa yang asin nan gurih, dan hangatnya Kopi ABC Susu yang rasanya mantap! Momen ceria bareng keluarga pun akan semakin hangat sambil nikmatin Kopi ABC Susu rame-rame.</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">Alamat : Jl. H. Ali Tegal Parang Selatan 1</p>\r\n<p style=\"text-align: center;\">Jam Buka : 16.00 – 21.00</p>', 'Cilok memiliki arti dari gabungan kata Aci yang dicolok, dan cilok yang satu ini cilok yang digoreng.', 0.00, 15, 'publish', 'Sarah Dyah Ayu', 1, '2018-04-04 14:13:14', '2018-04-05 21:35:51', '2018-04-05 21:35:51'),
(38, 123, 30, 'Hunkwe Mutiara Toko Mama Indah', 'Hunkwe Mutiara Toko Mama Indah', 'Hunkwe Mutiara Toko Mama Indah', 'Hunkwe,Hunkwe Mutiara', 'hunkwe-mutiara-toko-mama-indah', '2000', '<p>Hunkwe merupakan makanan yang termasuk dalam golongan jenis kue basah yang banyak diminati. Dengan memiliki tekstur yang sangat halus dan lembut juga sedikit kenyal, dan terdapat berbagai macam varian warna yang unik. Makanan ini dapat anda jadikan sebagai cemilan, bagi semua jenis kalangan. Bahan yang digunakan diantaranya sagu mutiara, tepung hunkwe, santan kelapa, gula pasir dan garam. Sajikan selagi dingin. Jangan lupa ditemani secangkir kopi ABC susu!</p>\r\n<p> </p>\r\n<p>Jam Buka : 09.00-17.00 WIB</p>', 'Hunkwe Mutiara Toko Mama Indah', 0.00, 14, 'publish', 'Sifqa Amalia Ramadhanti', 1, '2018-04-04 16:45:30', '2018-04-05 21:35:59', '2018-04-05 21:35:59'),
(39, 150, 33, 'Gabin Isi Telur Gegerkalong', 'Gabin Isi Telur Gegerkalong', 'Gabin Isi Telur Gegerkalong', 'Gabin,gabin isi telur,gabin gegerkalong', 'gabin-isi-telur-gegerkalong', '1500', '<p>Semua pasti tidak asing dengan roti gabin,nah saat ini banyak inovasi yang dibuat. Salah satunya yaitu gabin isi telur. Cemilan ini terbuat dari gabin yang diisi dengan adonan pastel dan ditambahkan potongan dari telur rebus. Lalu digoreng hingga garing. Cemilan ini paling enak dinikmati dengan minum kopi. Jajanan ini sangat mudah ditemui tentunya.</p>\r\n<p>Open : 06.00-14.00</p>', 'Gabin Isi Telur Di Pasar Geger Kalong', 0.00, 14, 'publish', 'Nuniek Agatri', 1, '2018-04-05 11:04:03', '2018-04-05 21:36:07', '2018-04-05 21:36:07'),
(40, 145, 34, 'Takoyaki Gegerkalong', 'Takoyaki Gegerkalong', 'Takoyaki Gegerkalong', 'takoyaki,takoyakigegerkalong,takoyaki bandung', 'takoyaki-gegerkalong', '10000', '<p>Takoyaki ini terbuat dari tepung terigu yang didalamnya juga terdapat bumbu-bumbu seperti daun bawang dan isian yang kita mau misalnya seefood. Bentuk dari makanan ini seperti bola kecil, takoyaki sangat popiler di Jepang,karan makanan satu ini adalah cemilan khas jepang. Takoyaki biasa dijual dalam bentuk set dengan 1 set berisi 5, 6, 8 hingga 10 buah.</p>\r\n<p> </p>\r\n<p>Open : 18.00-23.00</p>', 'Takoyaki di Gegerkalong', 0.00, 14, 'publish', 'Nuniek Agatri', 1, '2018-04-05 11:16:46', '2018-04-05 21:36:15', '2018-04-05 21:36:15'),
(41, 144, 33, 'Putu Ayu Pasar Geger Kalong', 'Putu Ayu Pasar Geger Kalong', 'Putu Ayu Pasar Geger Kalong', 'Putu ayu,putu ayu gegerkalong,putu ayu bandung', 'putu-ayu-pasar-geger-kalong', '2000', '<p>Kue putu ayu merupakan kue tradisional asli indonesia,kue putu ayu ialah salah satu koleksi dari kue jajanan pasar yang di miliki oleh indonesia.Putu ayu memiliki nama yang hampir sama dengan kue<br />putu,namun sebenarnya bahan dasar untuk pembuatan kue putu ayu s berbeda dengan kue putu yang hanya menggunakan tepung beras untuk adonannya. Dalam pembuatan kue putu ayu biasanya menggunakan beberapa bahan yang biasa di gunakan untuk membuat bolu kukus.persamaan dari kedua kue ini hanyalah pada pemakaian kelapa sebagai hiasannya. Kelapa dalam kue putu ayu juga dijadikan sebagai toping dari kue ini.</p>\r\n<p> </p>\r\n<p>Open : 06.00-14.00</p>', 'Putu Ayu Di Pasar Geger Kalong', 0.00, 14, 'publish', 'Nuniek Agatri', 1, '2018-04-05 11:25:11', '2018-04-05 21:36:21', '2018-04-05 21:36:21'),
(42, 140, 31, 'Bacang Daging Borma', 'Bacang Daging Borma', 'Bacang Daging Borma', 'Bacang ,bacang daging,bacang bandung', 'bacang-daging-borma', '12900', '<p>Bacang beras merupakan penganan tradisional masyarakat Cina Tiongkok yang dibungkus dengan daun bambu yang berisi beras dengan campuran daging dan berbentuk limas segitiga. Paling enak dimakan ketika masih panas. Bacang dibuat dari beras ketan sebagai lapisan luar, daging, jamur, udang kecil, seledri, dan jahe sebagai isi. Ada juga yang menambahkan kuning telur asin. Untuk perasa biasanya ditambahkan sedikit garam, gula, merica, penyedap makanan, kecap, dan sedikit minyak nabati.</p>\r\n<p> </p>\r\n<p>Open : 09.00-21.00</p>', 'Bacang Di Borma Setiabudhi', 0.00, 14, 'publish', 'Nuniek Agatri', 1, '2018-04-05 11:31:15', '2018-04-05 21:36:34', '2018-04-05 21:36:34'),
(43, 135, 33, 'Ali Agam Gegerkalong', 'Ali Agam Gegerkalong', 'Ali Agam Gegerkalong', 'ali agam,ali agam gegerkalong,ali agam bandung', 'ali-agam-gegerkalong', '5000', '<p>Ali agam merupakan jajanan yang saat ini jarang atau susah ditemui, tapi masi menjadi jajanan favorit untuk teman ngopi atau nge-teh. Jajanan ini biasanya banyak terdapat di pasar tradisional. Rasanya tidak kalah enak dengan jajanan pada saat sekarang ini. Jajanan ini terbuat dari tepung beras dan gula merah.</p>\r\n<p> </p>\r\n<p>Open : 06.00-14.00</p>', 'Ali Agam di Pasar Gegerkalong', 0.00, 14, 'publish', 'Nuniek Agatri', 1, '2018-04-05 11:36:45', '2018-04-05 21:36:42', '2018-04-05 21:36:42'),
(44, 138, 33, 'Apem Nasi Pelangi Gegerkalong', 'Apem Nasi Pelangi Gegerkalong', 'Apem Nasi Pelangi Gegerkalong', 'Apem,Apem pasar gegerkalong', 'apem-nasi-pelangi-gegerkalong', '3000', '<p>Apem nasi pelangi ini rasanya sama kaya apem pada umumnya cuma bentuknya aja yang beda, bentuknya hampir mirip kue mangkok. Satu box isinya 6 (2 pink, 2 putih, dan 2 hijau) tapi walaupun warna-warni, rasanya sama aja kok semuanya. Makan apem pelangi ini terus minumnya kopi ABC susu itu enak banget loh!</p>\r\n<p> </p>\r\n<p>Jam buka: 06.00-12.00</p>', 'Apem Nasi Pelangi Di Pasar Gegerkalong', 0.00, 14, 'publish', 'Olivia Alvionita', 1, '2018-04-05 12:03:36', '2018-04-05 21:36:48', '2018-04-05 21:36:48'),
(45, 139, 35, 'Bangket Keju Rotiku', 'Bangket Keju Rotiku', 'Bangket Keju Rotiku', 'Bangket,Bangket keju', 'bangket-keju-rotiku', '3800', '<p>Kue bangket keju ini cukup unik karena ada perpaduan dari rasa jahe, kayu manis, dan keju yang ditabur diatasnya. Aromanya jahe dan kayu manis banget deh. Untuk teksturnya sendiri bisa dibilang unik karena ngembang dan ‘retak-retak’. Kue ini paling enak dinikmatin selagi hangat dan minumnya kopi ABC susu!</p>\r\n<p> </p>\r\n<p>Jam Buka: 06.00-22.00</p>', 'Bangket Keju di Rotiku Setiabudi', 0.00, 14, 'publish', 'Olivia Alvionita', 1, '2018-04-05 12:12:29', '2018-04-05 21:36:59', '2018-04-05 21:36:59'),
(46, 142, 31, 'Bakpao Kacang Hijau Borma', 'Bakpao Kacang Hijau Borma', 'Bakpao Kacang Hijau Borma', 'Bakpao,bakpao kacang hijau,bakpao bandung', 'bakpao-kacang-hijau-borma', '2900', '<p>Bosen sama bakpao yang isinya cokelat? Bakpao ini isinya kacang hijau dan adonannya yang unik karena berwarna pink (merah muda). Makan bakpao ini enaknya saat masih panas supaya kacang hijau yang didalamnya jadi tambah lembut ketika dimakan bareng kopi ABC susu!</p>\r\n<p> </p>\r\n<p>Jam buka: 09.00-21.00</p>', 'Bakpao Kacang Hijau Borma Setiabudi', 0.00, 14, 'publish', 'Olivia Alvionita', 1, '2018-04-05 12:21:10', '2018-04-05 21:37:11', '2018-04-05 21:37:11'),
(47, 143, 35, 'Bolu Agar Agar Rotiku', 'Bolu Agar Agar Rotiku', 'Bolu Agar Agar Rotiku', 'Bolu,Bolu Agar Agar', 'bolu-agar-agar-rotiku', '2000', '<p>Bolu agar-agar ini unik banget, lho! Karena terdiri dari 3 lapisan, yaitu lapisan atasnya agar-agar, lapisan tengahnya seperti kocokan putih telur, dan lapisan terakhir alias lapisan yang bawah adalah bolunya yang lembut. Sensasinya beda banget kalo kita makan bolu ini dibanding dengan bolu biasanya, karena 3 perpaduan unik itu. Ngemil bolu ini paling enak kalo sambil ngopi ABC susu!</p>\r\n<p> </p>\r\n<p>Jam Buka: 06.00-22.00</p>', 'Bolu agar agar di Rotiku Setiabudi', 0.00, 14, 'publish', 'Olivia Alvionita', 1, '2018-04-05 12:35:02', '2018-04-05 21:37:17', '2018-04-05 21:37:17'),
(48, 148, 31, 'Onde Onde Borma', 'Onde Onde Borma', 'Onde Onde Borma', 'onde onde,onde onde borma,onde onde bandung', 'onde-onde-borma', '2200', '<p>Onde onde merupakan sejenis kue jajanan pasar berbentuk bulat dan berlapis wijen yang populer di Indonesia. Onde-Onde mudah ditemukan di pasar tradisional maupun dijual di pedagang kaki lima. Onde- Onde terbuat dari tepung terigu ataupun tepung ketan dan Onde-Onde biasanya berisi kacang hijau yang sudah ditumbuk. Onde-Onde sangat disukai oleh semua kalangan.</p>\r\n<p> </p>\r\n<p>Buka Mulai : 09.00 -21. 00 WIB</p>', 'Onde-Onde Di Borma Setiabudi Bandung', 0.00, 14, 'publish', 'Nuril Fitria', 1, '2018-04-05 12:43:24', '2018-04-05 21:37:25', '2018-04-05 21:37:25'),
(49, 137, 31, 'Bakpia Coklat Setiabudi', 'Bakpia Coklat Setiabudi', 'Bakpia Coklat Setiabudi', 'bakpia,bakpia coklat,bakpia bandung', 'bakpia-coklat-setiabudi', '3000', '<p>Kue Pia adalah salah satu cemilan yang disukai hampir seluruh masyarakat Indonesia. Pia Coklat ini memiliki cita rasa yang enak dan lezat, rasanya yang legit dengan bahan-bahan berkualitas dan harum yang khas, tercium dari bakpia ini. Ditambah dengan rasa coklat yang<br />membuat rasanya semakin lezat, apalagi jika dinikmati pada saat masih dalam keadaan hangat. Pia ini bisa menemani anda selagi anda mengobrol dengan teman-teman ada anda.</p>\r\n<p> </p>\r\n<p>Buka Mulai : 09.00 -21. 00 WIB</p>', 'Bakpia Coklat di Borma Setiabudi', 0.00, 14, 'publish', 'Nuril Fitria', 1, '2018-04-05 12:58:35', '2018-04-05 21:37:31', '2018-04-05 21:37:31'),
(50, 149, 33, 'Gemblong Gegerkalong', 'Gemblong Gegerkalong', 'Gemblong Gegerkalong', 'gemblong,gemblong gegerkalong,gemblong bandung', 'gemblong-gegerkalong', '1000', '<p>Gemblong merupakan sejenis makanan tradisional atau kue tradisional Indonesia yang termasuk ke dalam kelompok jajanan pasar. Gemblong terbuat dari adonan tepung beras ketan putih dan dibentuk bulat seperti bola kemudian adonan gemblong yang sudah dibentuk bulat digoreng dan dilapisi dengan larutan gula aren. Di daerah Jawa Timur gemblong dikenal dengan nama Getas. Gemblong sangat cocok untuk dinikmati sambil minum kopi di pagi hari ataupun sore hari.</p>\r\n<p> </p>\r\n<p>Buka Mulai : 06.00 -11. 00 WIB</p>', 'Gemblong adalah sejenis makanan tradisional atau kue tradisional Indonesia yang termasuk ke dalam kelompok jajanan pasar.', 0.00, 14, 'publish', 'Nuril Fitria', 1, '2018-04-05 13:23:58', '2018-04-05 21:37:37', '2018-04-05 21:37:37'),
(51, 133, 36, 'Cikak Setiabudhi', 'Cikak Setiabudhi', 'Cikak Setiabudhi', 'Cikak,Cikak setiabudhi', 'cikak-setiabudhi', '7000', '<p>Cikak adalah camilan yang memiliki bentuk unik yakni berbentuk buah buahan. Camilan ini terbuat dari tepung beras ketan yang kemudian dilapisi lagi dengan agar agar bening, tekstur dari cikak ini sangat Kenyal dan cikak juga memiliki isian yakni adonan kacang hijau yang memiliki rasa yang manis saat dimakan</p>\r\n<p>Buka Mulai : 7 Pagi – 10 malam</p>', 'Cikak adalah camilan yang memiliki bentuk unik yakni berbentuk buah buahan.', 0.00, 14, 'publish', 'Syifa Alawiyah', 1, '2018-04-05 13:40:23', '2018-04-05 13:40:23', NULL),
(52, 151, 37, 'Bakpao Apotek Rini', 'Bakpao Ayam', 'Bakpao Isi Ayam', 'bakpao,rawamangun,apotek rini', 'bakpao-apotek-rini', '8000', '<p style=\"text-align: center;\">BAKPAO  AYAM</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p><em>Pao</em> itu berarti bungkusan, dan <em>Bak</em> itu artinya <a href=\"https://id.wikipedia.org/wiki/Daging\">daging</a>, jadi <em>bakpao</em> berarti bungkusan berisi daging. Bakpao isi Ayam biasanya disebut KEHPAO dihargai Rp 8.000 per buahnya. Bakpao ini bisa kamu temui di ex-apotek Rini, Rawamangun, Jakarta Timur.  Bagi yang vegetarian juga bisa pilih isian kacang kedelai atau kacang hijau. Cocok dimakan  hangat-hangat sambil ngopi  kopi ABC Susu.</p>\r\n<p style=\"text-align: center;\">Tempat : Depan Apotek Rini Rawamangun</p>\r\n<p style=\"text-align: center;\">Jam Buka : 10.00 - 21.00</p>', 'Bakpao adalah makanan yang berasal dari negeri China, berbahan dasar tepung terigu yang diberi ragi sehingga mengembang, kemudian diberi aneka isian dan dikukus.', 0.00, 15, 'publish', 'Rika Masda', 1, '2018-04-05 14:15:22', '2018-04-05 21:37:44', '2018-04-05 21:37:44'),
(53, 134, 38, 'Koci Koci Klinik Lapar', 'Koci koci klinik lapar', 'Koci koci klinik lapar', 'koci,koci koci,koci bandung', 'koci-koci-klinik-lapar', '1000', '<p>Koci koci adalah camilan tradisional yang memiliki rasa unik sesuai dengan namanya. Berbentuk segitiga dan dibungkus oleh daun pisang koci koci memiliki rasa yang enak dan manis. Saat disantap rasa dari camilan ini akan terasa perpaduan antara ketan dan santan di bagian luar serta parutan kelapa muda di bagian dalam</p>\r\n<p> </p>\r\n<p>Buka Mulai : 8 pagi – 5.30 sore</p>', 'Koci koci adalah camilan tradisional yang memiliki rasa unik sesuai dengan\r\nnamanya.', 0.00, 14, 'publish', 'Syifa Alawiyah', 1, '2018-04-05 14:28:12', '2018-04-05 21:38:29', '2018-04-05 21:38:29'),
(54, 141, 31, 'Dadar Gulung Borma', 'Dadar Gulung Borma', 'Dadar Gulung Borma', 'dadar gulung,dadar gulung bandung', 'dadar-gulung-borma', '6000', '<p>Dadar gulung Cup Pak adalah camilan tradisional indonesia yang di dalamnya terbuat dari kelapa parut yang dicampur dengan gula merah dan dibalut dengan adonan tepung terigu dan tepung kanji. Rasa dari dadar gulung itu manis yang pas karena manisnya berasal dari pemanis alami dan gak ketinggalan juga lapisan kulit yang gurih bercampur rasa manis. Dadar gulung jadi camilan? Cocok banget pastinya!!</p>\r\n<p> </p>\r\n<p>Buka Mulai : 8 pagi – 9 malam</p>', 'Dadar Gulung adalah camilan tradisional indonesia yang di dalamnya terbuat\r\ndari kelapa parut yang dicampur dengan gula merah dan dibalut dengan adonan\r\ntepung terigu dan tepung kanji.', 0.00, 14, 'publish', 'Syifa Alawiyah', 1, '2018-04-05 14:33:46', '2018-04-05 21:39:31', '2018-04-05 21:39:31'),
(55, 146, 36, 'Srikaya Pandan Setiabudi', 'Srikaya Pandan Setiabudi', 'Srikaya Pandan Setiabudi', 'Srikaya,srikaya pandan', 'srikaya-pandan-setiabudi', '5000', '<p>Srikaya Pandan adalah camilan yang manis dan berwarna hijau yang dimana ditempatkan di mangkuk kecil/ wadah kecil. Rasa dari Srikaya Pandan ini manis, memiliki aroma pandan yang kuat dan kenyal, Bentuknya yang kenyal serupa dengan agar agar namun Srikaya memiliki tekstur berongga.</p>\r\n<p> </p>\r\n<p>Buka Mulai : 7 Pagi – 10 malam</p>', 'Srikaya Pandan adalah camilan yang manis dan berwarna hijau yang dimana\r\nditempatkan di mangkuk kecil/ wadah kecil.', 0.00, 14, 'publish', 'Syifa Alawiyah', 1, '2018-04-05 14:39:02', '2018-04-05 21:38:06', '2018-04-05 21:38:06'),
(56, 147, 38, 'Otok Owo Klinik Lapar', 'Otok Owo Klinik Lapar', 'Otok Owo Klinik Lapar', 'Otokowo,otok owo,otok owo bandung', 'otok-owo-klinik-lapar', '3500', '<p>Otok Owo adalah camilan tradisional yang berbentuk kue kering berwarna coklat dan berbentuk lingkaran. Kue ini memiliki perpaduan rasa yang unik, yakni manis yang berasal dari gula jawa, setelah disantap akan terasa asin dan hangat yang berasal dari jahe.</p>\r\n<p> </p>\r\n<p>Buka Mulai : 8 pagi – 5.30 sore</p>', 'Otok Owo adalah camilan tradisional yang berbentuk kue kering berwarna coklat dan\r\nberbentuk lingkaran.', 0.00, 14, 'publish', 'Syifa Alawiyah', 1, '2018-04-05 14:44:28', '2018-04-05 21:39:37', '2018-04-05 21:39:37');
INSERT INTO `foods` (`id`, `media_id`, `store_id`, `title`, `meta_title`, `meta_description`, `meta_tags`, `slug`, `price`, `text`, `short_text`, `rating`, `created_by`, `status`, `contributor`, `status_recomended`, `created_at`, `updated_at`, `deleted_at`) VALUES
(57, 152, 39, 'Cilok Bumbu Kacang', 'Cilok Bumbu Kacang', 'Cilok Bumbu Kacang', 'cilok,cipinang,cilok bumbu kacang', 'cilok-bumbu-kacang', '5.000', '<p style=\"text-align: center;\"><strong>CILOK BUMBU KACANG</strong></p>\r\n<p> </p>\r\n<p>Cilok adalah cemilan khas <a href=\"https://id.wikipedia.org/wiki/Jawa_Barat\">Jawa Barat</a>. Terbuat dari <a href=\"https://id.wikipedia.org/wiki/Tapioka\">tapioka</a> yang kenyal dengan tambahan bumbu pelengkap seperti <a href=\"https://id.wikipedia.org/wiki/Sambal_kacang\">sambal kacang</a>. Cilok bentuknya bulat-bulat seperti <a href=\"https://id.wikipedia.org/wiki/Bakso\">bakso</a>, hanya saja berbeda bahan dasarnya. Terdapat  daging cincang di dalamnya, karena terbuat dari bahan dasar tapioka maka cilok terasa kenyal saat dikonsumsi. Saat ini banyak ditemui gerobak cilok di Jakarta. Anak kecil senang jajan cemilan ini, yang dewasa bisa ngemil sambil ngopi Kopi ABC Susu.</p>', 'Cilok adalah jajanan yang banyak ditemui', 0.00, 15, 'publish', 'Rika Masda', 1, '2018-04-05 14:47:00', '2018-04-05 21:39:49', '2018-04-05 21:39:49'),
(58, 153, 40, 'Ketan Serundeng  Rusun Cipinang Muara', 'Ketan Serundeng Rusun Cipinang', 'Ketan Serundeng yang diijual di Rusun Cipinang', 'ketan,serundeng,ketan serundeng,betawi,cipinang', 'ketan-serundeng-rusun-cipinang-muara', '1500', '<p style=\"text-align: center;\">KETAN SERUNDENG</p>\r\n<p> </p>\r\n<p>Ketan Serundeng merup<strong>akan cemilan jadul tradisional </strong>Betawi. Saat ini masih bisa dijumpai di pasar tradisional, tapi harus pagi-pagi belinya, karena kalau siang udah h<strong>abis..hehe. Bagi pencinta gurih, </strong>pedas<strong> dan</strong> manis, cemilan ini cocok menemani Kopi ABC Susu kamu sarapan pagi. Berbahan dasar ketan dan dibalur serundeng, diband<strong>e</strong>rol harga  Rp 1.500 per buah.</p>\r\n<p> </p>\r\n<p style=\"text-align: center;\">Tempat : Rusun Cipinang Muara</p>\r\n<p style=\"text-align: center;\">Jam Buka : 06.00 - 11.00</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p> </p>\r\n<p> </p>', 'Ketan Serundeng adalah cemilan khas betawi yang sudah jarang ditemui', 0.00, 15, 'publish', 'Rika Masda', 1, '2018-04-05 15:31:14', '2018-04-05 21:39:57', '2018-04-05 21:39:57'),
(59, 154, 41, 'Kue Cucur Rusun Cipinang', 'Kue Cucur  Rusun Cipinang Muara', 'Kue Cucur  Rusun Cipinang Muara', 'kue cucur,cucur,cipinang,muara,jaktim', 'kue-cucur-rusun-cipinang', '1000', '<p style=\"text-align: center;\"><strong>KUE CUCUR</strong></p>\r\n<p> </p>\r\n<p>Kue Cucur khas Betawi ini wajib dihidangkan saat acara pernikahan adat Betawi. Tetapi sekarang bisa dinikmati  kapan saja kita mau, dengan harga Rp 1000 per buahnya. Kue cucur berbentuk bulat,  tebal menggembung seperti gunung di bagian tengah dan tipis garing di pinggirannya. Banyak pedagang yang menjualnya, ada dipasar tradisional atau pusat wisata kota . Kue cucur enak di makan saat hangat bersama Kopi ABS Susu.</p>\r\n<p> </p>\r\n<p style=\"text-align: center;\">Tempat : Rusun Cipinang Muara</p>\r\n<p style=\"text-align: center;\">Jam Buka : 06.00 - 11.00</p>', 'Kue Cucur khas Betawi ini wajib dihidangkan saat acara pernikahan adat Betawi', 0.00, 15, 'publish', 'Rika Masda', 1, '2018-04-05 16:39:42', '2018-04-05 21:40:07', '2018-04-05 21:40:07'),
(60, 157, 31, 'Bola-Bola Oreo', 'Bola-Bola Oreo', 'Bola-Bola Oreo', 'Bola-Bola Oreo,Cemilan,Kue,Kue Kering', 'bola-bola-oreo', '7000', '<p>Bola-bola oreo ini memiliki banyak varian rasa juga, mulai dari oreo, green tea, vanilla dan lainnya. Untuk rasanya udah pasti enak banget! Karena rasa dari bola bola oreo ini manis susu namun di dalamnya ada <em>crunchy</em> biscuit dan juga tidak ketinggalan ada taburan oreo di seluruh permukaan bola bola oreo ini yang saat disantap akan menambahkan rasa enaknya</p>', 'Bola-bola oreo adalah camilan kekinian', 0.00, 19, 'publish', 'Syifa', 1, '2018-04-06 01:30:19', '2018-04-06 01:30:19', NULL),
(61, 166, 42, 'Kue Ape Kebon  Jeruk', 'Kue Ape Kebon  Jeruk', 'Kue Ape Kebon  Jeruk', 'kue ape,kue ape jakarta', 'kue-ape-kebon-jeruk', '1000', '<p style=\"text-align: justify;\">Kue Ape ini salah satu jajanan tradisional yang banyak di gemari oleh masyarakat indonesia loh. Selain bentuknya yang unik rasanya pun enak banget, apalagi dimakan saat pagi hari yang cerah ditemani dan secangkir mantapnya paling nikmat Kopi ABC Susu. Kolaborasi yang paling mantap untuk menemani pagi yang cerah ini guys.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p>Buka mulai      : 07.00 – 14.00 WIB</p>', 'Kue Ape adalah  jajanan khas dari Jakarta. Bentuknya menyerupai pancake.', 0.00, 14, 'publish', 'Dian Fatmala Sari', 1, '2018-04-06 22:05:09', '2018-04-06 22:05:09', NULL),
(62, 167, 43, 'Kue Cucur Pasar Pagi', 'Kue Cucur Pasar Pagi', 'Kue Cucur Pasar Pagi', 'Kue Cucur ,Kue Cucur Kebon jeruk', 'kue-cucur-pasar-pagi', '1500', '<p style=\"text-align: justify;\">Siapa hayo yang belum tau cemilan tradisional satu ini? Ini adalah kue cucur. Kue cucur ini terbuat dari tepung beras dan gula aren yang digoreng. Teman pagiku bersama kue cucur yang gurih dan manis dilengkapi dengan kopi ABC Susu membuat pagiku lebih cerah dan membuat pagiku lebih cerah dan membuatku semangat menjalani hari.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p>Buka mulai      : 06.00 – 09.00 WIB</p>', 'Kue Cucur adalah salah satu jajanan tradisional di Indonesia', 0.00, 14, 'publish', 'Dian Fatmala Sari', 1, '2018-04-06 22:30:48', '2018-04-06 22:30:48', NULL),
(63, 105, 26, 'Apem Panggang', 'Apem Panggang Pastellia', 'Apem panggang', 'Apem,apem,panggang,Apem Panggang,Pastellia,BSD', 'apem-panggang', '7500', '<p>Apem panggangg yang akan kita review ini adalah Apem panggang dari <em>toko cemilan</em>&nbsp;<em>Pastellia </em>di Pasar Modern BSD, dikenal dengan rasanya yang manis dan gurih, apem panggang ini terasa sangat nikmat jika di santap saat masih hangat, tips untuk kamu yang ingin menikmati Apem Panggang ini, usahakan kamu datang ke toko ini pagi, karena biasanya di toko ini mereka sudah menyiapkan segala cemilan yang ada di pagi hari, dan kamu masih bisa menikmati hangatnya Apem Panggang ini sampai jam 8 pagi.</p>\r\n<p>Buka: Setiap hari, pukul 05.30 WIB &ndash; 20.00 WIB</p>', 'Apem panggangg adalah salah satu cemilan yang nusantara banget, dikenal dengan rasanya yang manis dan gurih, apem memiliki adonan khas yang hhanya bisa di buat dengan campuran santan didalam adonannya', 0.00, 13, 'publish', 'Mia', 1, '2018-04-08 18:05:11', '2018-04-09 13:28:02', NULL),
(64, 106, 26, 'Gethuk singkong', 'Gethuk', 'Gethuk singkong', 'Gethuk,Gethuk singkong,Pastellia', 'gethuk-singkong', '4500', '<p>Bagi kamu yang memiliki kampung halaman di daerah jawa tengah atau jawa timur, menyantap gethuk singkong dari Toko cemilan&nbsp;<em>Pastellia </em>ini memiliki rasa yang cukup membuat kamu bernostalgia,&nbsp;kenapa, karena lembutnya adonan singkong dengan taburan kelapa parut ini, cukup membuat kamu teringat dengan kampung halaman, hmmm.. Rasa klasik yang tepat untuk teman ngopi.</p>\r\n<p>Buka: Setiap hari, pukul 05.30 WIB &ndash; 20.00 WIB</p>', 'Gethuk adalah salah satu cemilan yang sangat khas dari jawa tengah, yang terbuat dari olahan singkong dengan di taburi kelapa parut yang gurih', 0.00, 13, 'publish', 'Mia', 1, '2018-04-08 18:08:02', '2018-04-09 13:34:43', NULL),
(65, 168, 44, 'Kuping Gajah Pasar Musyawarah', 'Kuping Gajah Pasar Musyawarah', 'Kuping Gajah Pasar Musyawarah', 'kuping gajah,kuping gajah cemilan,kue kuping gajah', 'kuping-gajah-pasar-musyawarah', '3500', '<p style=\"margin: 0cm; margin-bottom: .0001pt; text-align: justify; line-height: 150%; background: white;\"><span style=\"color: #222222; background: white;\">Nah ini namanya unik baget nih, Kuping Gajah. Tapi bukan kuping gajah beneran ya guys. Ini Cuma sebutan aja karna bentuk dari kripik ini mirip banget sama kuping gajah. Kripik kuping gajah ini renyah banget rasanya yang manis cocok banget dimakan bareng secangkir hangatnya kopi ABC Susu. Enak banget nih buat cemilan sore hari apalagi di saat mendung begini.</span></p>\r\n<p style=\"margin: 0cm; margin-bottom: .0001pt; text-align: justify; line-height: 150%; background: white;\"> </p>\r\n<p>Buka mulai      : 06.00 – 10.00 WIB</p>', 'Kuping Gajah adalah cemilan tradisonal yang masih di gemari hingga saat ini.', 0.00, 14, 'publish', 'Dian Fatmala Sari', 1, '2018-04-08 20:20:59', '2018-04-08 20:20:59', NULL),
(66, 158, 45, 'Onde-onde Verina', 'Onde-onde Verina', 'Onde-onde Verina', 'Onde-onde,onde-onde verina,jatinangor,bandung,onde', 'onde-onde-verina', '2000', '<p><br data-mce-bogus=\"1\"></p>', 'Bulat, renyah, kejutan di dalam, dan bertabur wijen. Yap ini dia Onde-onde! Onde-onde merupakan jajanan khas dari daerah Mojokerto. Namun karena Onde-onde disukai orang Indonesia dari berbagai daerah, kita bisa menemukan Onde-onde di mana saja.', 0.00, 13, 'publish', 'Abdillah', 1, '2018-04-08 21:54:02', '2018-04-08 21:54:02', NULL),
(67, 159, 45, 'Brownies mini', 'Brownies', 'Brownies', 'Brownies,mini,jatinangor', 'brownies-mini', '3000', '<p>Cokelat kehitaman, padat, dan manis. Apalagi kalau bukan brownies? Yap! Kue satu ini memang sebenarnya bukan asli dari Indonesia. Namun, karena digemari oleh masyarakat Indonesia, muncullah inovasi-inovasi yang diterapkan pada brownis. Mulai dari brownis kukus, brownis panggang, juga brownis bakar. Bahkan ada juga yang memadukan brownis dengan tapai lho! Memang sih jajanan yang bisa kita jumpai dengan mudah di berbagai toko kue ini tidak pernah salah, apalagi jika dipadukan dengan Kopi ABC Susu.</p>\r\n<p> </p>\r\n<p>Buka: Setiap hari, pukul 05.30 WIB – 20.00 WIB</p>', 'Cokelat kehitaman, padat, dan manis. Apalagi kalau bukan brownies? Yap! Kue satu ini memang sebenarnya bukan asli dari Indonesia. Namun, karena digemari oleh masyarakat Indonesia', 0.00, 13, 'publish', 'Abdillah', 1, '2018-04-08 22:03:54', '2018-04-08 22:03:54', NULL),
(68, 161, 45, 'Soes Verina', 'Soes', 'Soes Verina Jatinangor Bandung', 'Soes,Verina,Bandung', 'soes-verina', '1500', '<p>Nah, Soes kali ini bisa kamu dapatkan di toko kue <em>Verina Kue &amp; Snack&nbsp;</em>di jatinangor. Soes yang di sediakan Verina ini cukup menarik karena ada taburan keju diatasnya, sehingga kamu bisa merasakan tekstur ekstra krispi disini, dengan isian fla lembut yang tidak terlalu manis, membuat rasa, tekstur, hingga sensasi yang di dapat lebih menarik di setiap gigitan. dan ditambah lagi&nbsp;<em>Verina Kue &amp; Snack&nbsp;</em>ini tidak sulit di temukan, kamu bisa menemukannya tepat di pinggir jalan jatinangor.</p>\r\n<p>Buka: Setiap hari, pukul 05.30 WIB &ndash; 20.00 WIB</p>', 'Soes atau yang akrab disebut Kue Sus merupakan kue peninggalan Belanda yang akhirnya banyak digemari oleh masyarakat Indonesia.', 0.00, 13, 'publish', 'Abdillah', 0, '2018-04-08 22:14:54', '2018-04-09 12:57:43', NULL),
(69, 162, 45, 'Cheese Roll', 'Cheese Roll', 'Cheese Roll', 'Cheese Roll,keju,Keju,cheese roll,rol keju', 'cheese-roll', '2000', '<p>Untuk kalian pecinta keju, pasti jajanan satu ini tidak akan asing. Ya, Cheese Roll! Meskipun dikatakan bahwa Cheese Roll merupakan makanan yang populer di New Zealand, tapi Cheese Roll khas nusantara juga Indonesia punya lho. Di mana lagi kalau bukan di daerah Bandung, Jawa Barat. Olahan keju yang digulung dengan lapisan adonan roti dan dipanggang hingga kering di sini. Rasa manisnya lapisan roti serta gurihnya keju bisa kamu dapatkan dengan datang ke toko ini.</p>\r\n<p>&nbsp;</p>\r\n<p>Buka: Setiap hari, pukul 05.30 WIB &ndash; 20.00 WIB</p>', 'Ya, Cheese Roll! Meskipun dikatakan bahwa Cheese Roll merupakan makanan yang populer di New Zealand, tapi Cheese Roll khas nusantara juga Indonesia punya lho. Di mana lagi kalau bukan di daerah Bandung, Jawa Barat.', 0.00, 13, 'publish', 'Abdillah', 1, '2018-04-08 22:21:56', '2018-04-09 13:22:33', NULL),
(70, 163, 47, 'Kue Balok', 'Kue Balok', 'Kue balok', 'Kue Balok,Balok,balok,kue balok,Bandung,mang Salam', 'kue-balok', '3000', '<p>Kue Balok merupakan jajanan dikenal sejak tahun 1990an, tapi kembali tenar baru-baru ini. Jajanan khas dari daerah Jawa Barat ini disebut-sebut sebagai kembaran dari kue pukis karena memiliki rasa serta bentuk yang mirip. Kue Balok kembali tenar dengan varian rasa serta topping yang lebih beragam, dari  <em>green tea, </em>tiramisu, coklat, nutella, dan masih banyak lagi. Selain itu kita juga bisa memilih ingin membeli Kue Balok yang matang atau setengah matang. Kue Balok pas menjadi teman ngobrol bersama teman-teman dan ditemani secangkir Kopi ABC Susu!</p>', 'Jajanan Jawa Barat ini disebut sebagai kembaran dari kue pukis karena memiliki rasa serta bentuk yang mirip. Kue Balok kembali tenar dengan varian rasa serta topping yang lebih beragam, dari  green tea, tiramisu, coklat, nutella, dan DLL. Selain itu ada Kue Balok yang matang atau setengah matang.', 3.00, 13, 'publish', 'Abdillah', 1, '2018-04-08 22:38:45', '2018-04-09 15:11:41', NULL),
(71, 164, 45, 'Dadar Gulung  - Verina Kue & Snack', 'Dadar Gulung Verina', 'Dadar Gulung Verina', 'Dadar Gulung,dadar gulung,Verina,Darlung,darlung,DarLung,Bandung,bandung', 'dadar-gulung-verina-kue-snack', '1500', '<p>Berwarna hijau dan manis di dalam. Apakah itu? Ya, dadar gulung. Dadar Gulung adalah salah satu makanan khas Indonesia yang berasal dari Pulau Jawa. Jajanan tradisional ini&nbsp; terbuat dari tepung beras dan campuran pandan sebagai kulit, serta parutan kelapa dan gula merah, kemudian digulung. Warna hijau pada dadar gulung berasal dari campuran pandan atau suji. Ternyata selain berisi parutan kelapa yang dicampur gula merah cair, dadar gulung juga ada yang berisi pisang dan fla lho. Jangan lupa, Dadar Gulung sangat cocok dinikmati dengan Kopi ABC Susu!</p>', 'Berwarna hijau dan manis di dalam. Apakah itu? Ya, dadar gulung. Dadar Gulung adalah salah satu makanan khas Indonesia yang berasal dari Pulau Jawa. Jajanan tradisional ini  terbuat dari tepung beras dan campuran pandan sebagai kulit, serta parutan kelapa dan gula merah, kemudian digulung.', 0.00, 13, 'publish', 'Abdillah', 1, '2018-04-08 22:44:23', '2018-04-08 22:45:09', NULL),
(72, 185, 48, 'Nagasari Pancoran', 'Nagasari Pancoran', 'Nagasari Pancoran', 'Nagasari,Nagasari Pancoran', 'nagasari-pancoran', '1500', '<p>Hallo, Mungkin kalian sering sekali melihat jajanan pasar yang satu ini namun jarang ada yang tau nama asli camilan tersebut. Nagasari, jajanan yang terbuat dari tepung beras dan santan ini memiliki tekstur yang lembut dan meleleh ketika dimakan. Isian pisang pada nagasari memberikan rasa manis alami dan menabah kesan tersendiri saat memakanya. Perpaduan tepung beras, santan dan isian pisang membuat nagasari menjadi cemilan ringan yang cukup digemari sampai sekarang</p>\r\n<p> </p>\r\n<p>Jam Buka : 11:00 – 21:00</p>', 'Nagasari adalah sejenis kue yang terbuat dari tepung beras, tepung sagu, santan, dan gula yang diisi pisang', 0.00, 14, 'publish', 'Putri Eva Riani', 1, '2018-04-08 23:45:09', '2018-04-08 23:45:09', NULL),
(73, 186, 49, 'Onde-Onde Pancoran', 'Onde-Onde Pancoran', 'Onde-Onde Pancoran', 'Onde Onde,Onde onde pancoran', 'onde-onde-pancoran', '1000', '<p>Hai, kalian tau gak onde-onde cemilan khas dari mana? Onde-Onde yang terbuat dari tepung ketan yang di taburi dengan wijen ini berasal dari daerah Mojokerto loh. Onde-onde ini juga terbuat dari kacang hijau dan gula merah. Onde-onde ini memiliki tekstur yang kenyal. Rasa kenyal ini berasal dari kulitnya loh. Perpaduan rasa ini sangat berbeda dari cemilan khas Indonesia lainnya loh. Onde-onde ini biasanya disajikan secara panas.</p>\r\n<p> </p>\r\n<p>Jam Buka       : 13.00 - 19.00</p>', 'Onde-onde terbuat dari tepung terigu ataupun tepung ketan yang digoreng atau direbus dan permukaannya ditaburi/dibalur dengan biji wijen', 0.00, 14, 'publish', 'Putri Eva Riani', 1, '2018-04-08 23:59:35', '2018-04-08 23:59:35', NULL),
(74, 189, 50, 'Otak-Otak Crispy Depok', 'Otak-Otak Crispy Depok', 'Otak-Otak Crispy Depok', 'otak-otak,otak-otak crispy', 'otak-otak-crispy-depok', '1000', '<p>Cemilan yang satu ini namanya Otak-Otak <em>Crispy, </em>cemilan yang satu ini emang renyah banget sih apalagi kalau dimakannya pas anget-anget, <em>beuh..</em>rasanya sama aja kaya otak-otak pada umumnya yang di goreng bedanya otak-otak ini di balut dengantepung super renyah dengan warna yang super menggoda. Otak-otak ini pas banget kalo dimakannya pake saus sambal ditambah minumnya yang pasti kopi susu ABC dong~.</p>\r\n<p> </p>\r\n<p>Buka mulai pukul 11.00 – 19.00 WIB</p>', 'Otak Otak Crispy di Depok ini enak banget loh', 0.00, 14, 'publish', 'Windy Camelia', 1, '2018-04-09 11:09:34', '2018-04-09 11:09:34', NULL),
(75, 190, 51, 'Bakwan Mpok Aap', 'Bakwan Mpok Aap', 'Bakwan Mpok Aap', 'bakwan,bakwan mpok aap', 'bakwan-mpok-aap', '1000', '<p style=\"text-align: justify;\">Bakwan sayur dan bakwan jagung ini selain mengenyangkan bakwan ini sangat sehat untuk nutrisi kebutuhan setiap hari. Apalagi ditemani dengan kopi ABC Susu yang mantap rasa susunya. Bakwan sayur dan bakwan jagung ini rasanya renyah dan lembut di dalam. Cocok deh buat ganjel perut kamu kalo lagi lapar.</p>\r\n<p> </p>\r\n<p>Buka mulai      : 05.30 – 09.00 WIB</p>', 'Bakwan adalah makanan gorengan yang terbuat dari sayuran dan tepung terigu yang lazim ditemukan di Indonesia', 0.00, 14, 'publish', 'Dian Fatmala Sari', 1, '2018-04-09 11:26:07', '2018-04-09 11:26:07', NULL),
(76, 191, 50, 'Bakso Goreng Depok', 'Bakso Goreng Depok', 'Bakso Goreng Depok', 'Bakso,Bakso goreng', 'bakso-goreng-depok', '1000', '<p>Cemilan yang satu ini namanya ‘Basreng’. Cemilan yang digemari berbagai kalangan ini eksis dimana-mana lho! Jika kita biasanya makan bakso yang di campur kuah, kali ini baksinya digoreng mengguakan tepung krispi. Rasanya yang gurih apalagi dicampur oleh berbagai bumbu seperti rasa <em>barbeque</em>, manis, asin, pedas dan keju menambah kenikmatan basreng ini. Cemilan ini akan semakin nikmat jika di makannya bersama Kopi Susu ABC sebagai minumannya lho teman-teman.</p>\r\n<p> </p>\r\n<p>Buka mulai pukul 11.00 – 19.00 WIB</p>', 'Bakso goreng atau yang biasa di sebut Basreng, ini adalah bakso yang di goreng hingga kering.', 0.00, 14, 'publish', 'Windy Camelia', 1, '2018-04-09 11:43:50', '2018-04-09 11:43:50', NULL),
(77, 192, 53, 'French Fries 9\'s Hous Caffe', 'French Fries 9\'s Hous Caffe', 'French Fries 9\'s Hous Caffe', 'French Fries 9\'s Hous Caffe,9\'s house caffe,kentang goreng', 'french-fries-9-s-hous-caffe', '10000', '<p style=\"text-align: justify;\">Siapa sih yang gak tau cemilan yang satu ini. Cemilan kentang goreng ini banyak banget diminati berbagai kalangan, kentang goreng yang satu ini rasanya renyah banget dan yang pasti enak banget. Kentang goreng ini di sajikan dalam keadaan masih hangat dan di goreng sangat garing. Jangan lupa cocol dengan sausnya.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p>Buka 11.00 – 23.00</p>', 'Kentang goreng adalah hidangan yang dibuat dari potongan-potongan kentang yang digoreng dalam minyak goreng panas', 0.00, 14, 'publish', 'Julius Subang', 1, '2018-04-09 13:08:20', '2018-04-09 13:08:20', NULL),
(78, 187, 52, 'Dadar Gulung Permata Kuningan', 'Dadar Gulung Permata Kuningan', 'Dadar Gulung Permata Kuningan', 'Dadar,gulung,darlung,permata kuningan', 'dadar-gulung-permata-kuningan', '2000', '<p style=\"text-align: center;\"><strong>DADAR GULUNG</strong></p>\r\n<p><strong> </strong></p>\r\n<p>Setiap pagi, di kantor selalu ada bapak-bapak yang datang untuk menjajakan dagangannya, yaitu jajanan nusantara dan nasi uduk bungkus untuk sarapan. Nah, cemilan yang dibuat dari tepung beras dan pandan inilah yang jadi langgananku. Yup, dadar gulung. Rasa manis gula jawa yang dipadukan dengan parutan kelapa ini cocok untuk memulai hariku, apalagi kalau sambil minum kopi. Mantap! Supaya praktis, aku selalu stok kopi sachet di laci untuk kebutuhan sehari-hari. Entah itu kopi ABC Susu atau ABC Mocca. Kalau kamu pagi-pagi suka jajan apa?</p>\r\n<p> </p>\r\n<p style=\"text-align: center;\">Alamat            : Permata Kuningan – Jl. Kuningan Mulia, Setiabudi, Jakarta Selatan</p>\r\n<p style=\"text-align: center;\">Jam Buka        : 06.00-18.00</p>', 'Dadar Gulung adalah Jajanan Tradisional  yang mudah ditemui dan rasanya tergolong diterima oleh umum', 0.00, 15, 'publish', 'Febriyanti Wulan Dari', 1, '2018-04-09 13:26:26', '2018-04-09 13:26:26', NULL),
(79, 193, 49, 'Donat Pancoran', 'Donat Pancoran', 'Donat Pancoran', 'donat jakarta,donat,donat gula', 'donat-pancoran', '1000', '<p style=\"text-align: justify;\">Kalian tau gak kalo salah satu makanan khas Indonesia ini udah ada sebelum nama Jakarta menjadi Batavia. Namanya Donat Cincin. Donat cincin ini mempunyai rasa manis yang diberikan dari gula halus yang dicampur dengan diluar donatnya. Tekstur yang donat ini lembut apalagi kalau disajikannya saat panas-panas atau baru matang. Donat ini cocok banget buat cemilan di pagi atau sore hari saat hujan turun apalagi makanannya di temennin sama seduhhan kopi susu abc yang rasa manisnya pas banget.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p>Jam : 16:00 – 21:00</p>', 'Donat adalah penganan yang digoreng, dibuat dari adonan tepung terigu, gula, telur dan mentega.', 0.00, 14, 'publish', 'Putri Eva Riani', 1, '2018-04-09 13:32:36', '2018-04-09 13:32:36', NULL),
(80, 194, 54, 'Gemblong Pasar Minggu', 'Gemblong Pasar Minggu', 'Gemblong Pasar Minggu', 'gemblong,pasar minggu,pasar,minggu,jaksel,jakarta,selatan', 'gemblong-pasar-minggu', '2000', '<p style=\"text-align: center;\"><strong>GEMBLONG</strong></p>\r\n<p> </p>\r\n<p>Nah, kalau kue lonjong satu ini namanya gemblong, jajanan tradisional khas Indonesia. Gemblong ini terbuat dari adonan tepung beras ketan putih yang dilapisi dengan larutan gula aren disekelilingnya. Rasanya yang manis cocok untuk memulai harimu, apalagi kalau ditemani dengan minum kopi. Sedap! Kamu cukup seduh kopi ABC Susu atau ABC Mocca dengan air hangat dan kamu siap untuk memulai harimu dengan semangat!</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">Alamat            : Kawasan Pasar Minggu, Jakarta Selatan</p>\r\n<p style=\"text-align: center;\">Jam Buka        : 06.00-10.00</p>', 'Gemblong adalah Olahan Ketan yang dibalut dengan Gula Aren.', 0.00, 15, 'publish', 'Febriyanti Wulan Dari', 1, '2018-04-09 14:30:02', '2018-04-09 14:30:02', NULL),
(81, 221, 55, 'Putu Bangka 8', 'Putu Bangka 8', NULL, 'Kue Putu,Putu Jakarta', 'putu-bangka-8', '1000', '<p style=\"text-align: justify;\">Hallo, kalian tau ga sih kalo putu adalah salah satu makanan khas jawa loh. Putu merupakan salah satu cemilan yang berbahan dasar tepung beras, gula merah dan parutan kelapa. Cara pembuatannya juga sangat seserhana hanya dengan di kukus dalam kurang lebih 15 menit kalian bisa langsung menikmati putu tanpa harus menunggu lama.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p>Jam Buka  :  16.00 – 17.00 sore</p>', 'Kue putu adalah jenis makanan Nusantara berupa kue yang berisi gula jawa dan parutan kelapa, tepung beras butiran kasar', 0.00, 14, 'publish', 'Putri Eva Riani', 1, '2018-04-09 15:11:49', '2018-04-09 15:11:49', NULL);
